1c06a200-4372-47f2-911d-cd6a1ee68be2	getting_started_01	Monica's Discovery Lab	01KB0VXV0013MJ9BY6YTRJ9HM2	Meet Monica and learn what NBG is and why it matters for retention.	f	\N	2025-11-25 04:14:21.639542+00	2025-11-25 04:14:21.639542+00	\N	0e0bef5d-c90c-447a-9100-1f1ce78882ba	0	XGvIr3Yn	typeform	\N	a49f7952-3544-4c80-88b1-9be4a4e4e92c	introduce	fundamentals	Activity 1: Monica Introduction (typeform)\nInternal Name: getting_started_nbg_intro\nDisplay Name: "Introduction to NBG"\nLoop Type: introduce\nActivity Type: typeform\nContent:\nmarkdown## Welcome to NBG Training!\n\n### Monica's Opening:\n"Hey there! I'm Monica, and I'm going to be your guide through NBG - Next Booking Guidance. This is the most important skill you'll learn for retention. Let's start with the basics."\n\n### What is NBG?\n\nNBG stands for **Next Booking Guidance** - it's the framework you use at the END of a session to secure ongoing work with your client.\n\n**Video: Monica explains the 3 steps**\n"NBG has three steps that always happen in this order:\n\n1. **Future Work** - Paint the picture of what you'll work on together\n2. **Booking** - Lock in the next session time  \n3. **Purchase** - Confirm their coaching plan investment\n\nThink of it like a conveyor belt - each step naturally leads to the next."\n\n### Monica's Question #1:\n"Why does the order matter? What happens if you try to get payment BEFORE booking a time?"\n\n**Multiple Choice:**\n- A) Nothing - the order doesn't really matter\n- B) Clients feel less committed because there's no concrete appointment anchoring their decision\n- C) It's just a preference, not a rule\n- D) Booking first is just tradition\n\n**Correct Answer:** B\n\n**Monica's Explanation:**\n"YES! When someone has a specific time on their calendar, they've mentally committed to continuing. Payment becomes the natural next step. But if you ask for payment first without a concrete appointment? That's a scary decision point that invites hesitation."\n\n### Monica's Question #2:\n"You just had a great session with a client. When should you START the NBG process?"\n\n**Multiple Choice:**\n- A) Right at the beginning to set expectations\n- B) Whenever the client brings it up\n- C) With 10-15 minutes remaining in the session\n- D) After they ask about next steps\n\n**Correct Answer:** C\n\n**Monica's Explanation:**\n"EXACTLY! You need 10-15 minutes to do NBG properly. Start too late and you'll rush or go overtime. Start too early and the coaching feels incomplete. With 10-15 minutes left, you wrap up the coaching content naturally and transition into NBG."\n\n### Monica's Question #3:\n"A client just had a breakthrough in your session. They're feeling hopeful and energized. This is the perfect moment to..."\n\n**Multiple Choice:**\n- A) Let them sit with it and reach out when they're ready\n- B) Transition into NBG and secure the next session\n- C) Send them a calendar link to book when convenient\n- D) Wait to see if they bring up continuing\n\n**Correct Answer:** B\n\n**Monica's Explanation:**\n"YES! Clients are MOST likely to commit when they're coming out of a great session feeling hopeful. That's peak buying energy. Don't let that moment pass - guide them into the next steps while they're feeling the value."\n\n### The Mindset\n\n**Video: Monica's Key Point**\n"Here's what shifts everything: NBG isn't separate from coaching - it's an EXTENSION of the care you've shown all session. You're not 'switching to business mode.' You're helping them commit to their own growth.\n\nWhen you genuinely believe coaching will help this client - which you should - then guiding them through NBG isn't pushy. It's leadership. It's serving them."\n\n### What You'll Learn Next\n\n"Now that you understand WHAT NBG is and WHY it matters, you're going to see what good NBG looks like in action with a real client. Let's meet Kerry..."\n\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
3ca56ad8-611c-4391-85a5-f545b34e6f1f	fw_opening_intro_pattern	Discover the 4 Elements of Opening	\N	Learn to identify what makes a complete Opening by watching coach examples.	t	\N	2025-11-25 00:49:03.132255+00	2025-11-25 00:49:03.132255+00	\N	5be169a2-1769-427c-9145-504e80f9a958	0	\N	typeform	\N	bd855d34-6de2-48dc-b980-6b56f9131484	introduce	fundamentals	\n## INTRODUCE LOOP 1: Discovery Through Pattern Recognition\n\n**Active Learning Tactic:** Take away part of the information, learner fills in what's missing\n\n### Monica's Setup:\n"Let's watch three different coaches wrapping up their sessions. Pay attention to what they say RIGHT BEFORE they start talking about future work."\n\n### Video Clip A (Complete Opening):\n*Coach says:* "So what we've uncovered today is that your anxiety around dating is really about fear of losing yourself like you did with Paul. [SUMMARY] I know how exhausting it's been - feeling like you're walking on eggshells, rehearsing conversations in your head. [FEELINGS] I know how important it is for you to date without losing yourself. [GOAL] So here's what our work together will look like going forward..."\n\n### Video Clip B (Missing Feelings):\n*Coach says:* "So we talked about your dating anxiety and how it connects to your past relationship. [SUMMARY] You want to be able to date confidently. [GOAL] So here's what we'll work on..."\n\n### Video Clip C (Missing Goal):\n*Coach says:* "So you're struggling with anxiety when dating because of what happened with Paul. [SUMMARY] I know that's been really hard on you. [FEELINGS] So here's the plan..."\n\n### Monica's Question:\n"Which coach gave the MOST complete opening? What did the other coaches forget to include?"\n\n**Choices:**\n- A) Coach A - they covered everything\n- B) Coach B - they just needed to add feelings  \n- C) Coach C - they forgot the goal\n\n**Correct Answer:** A\n\n**Feedback if wrong:** "Let's watch Coach A again. Notice how they covered THREE things before transitioning: what they uncovered (summary), how the client feels (feelings), and what the client wants (goal). That's what makes it complete!"\n\n### Key Learning:\nThe 4 required elements of Opening are:\n1. Summary & Analysis\n2. Feelings Reflection\n3. Goal Reflection\n4. Transition to Game Plan\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
0e77a3eb-aaed-49bd-9ea2-ecab5e39f960	fw_opening_intro_specificity	Generic vs Specific Language	\N	Discover why specific language builds deeper connection than generic statements.	t	\N	2025-11-25 00:49:03.132255+00	2025-11-25 00:49:03.132255+00	\N	5be169a2-1769-427c-9145-504e80f9a958	1	\N	typeform	\N	bd855d34-6de2-48dc-b980-6b56f9131484	introduce	fundamentals	\n## INTRODUCE LOOP 2: Specificity Discovery\n\n**Active Learning Tactic:** Give examples and have them extract the rule\n\n### Monica's Setup:\n"Now let's compare HOW two coaches expressed the same opening. Both coaches are correct about the content, but one will build WAY more connection."\n\n### Video Side-by-Side:\n\n**Coach 1 (Generic):**\n"I know this relationship has been hard on you and you want things to get better."\n\n**Coach 2 (Specific):**\n"I know how difficult it's been since that fight with Jake last Tuesday - feeling like you're walking on eggshells every time you try to bring up your needs, that pit in your stomach every time his name pops up on your phone."\n\n### Monica's Question:\n"Which coach will make the client feel MORE understood?"\n\n**Answer:** Coach 2\n\n### Monica's Follow-up:\n"What's the difference between these two? What did Coach 2 include that Coach 1 didn't?"\n\n### Discovery Prompt:\n*Identify the specific elements Coach 2 used:*\n- "that fight with Jake last Tuesday" → [Specific Event]\n- "Jake" → [Name]\n- "walking on eggshells" → [Client's Words]\n- "pit in your stomach" → [Physical Feeling]\n- "every time his name pops up" → [Specific Situation]\n\n### Monica's Summary:\n"YES! Coach 2 used the client's actual name, referenced a specific event from their conversation, and used language the client actually said. That's what specificity means - and it's what makes clients feel SEEN."\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
c7adfa35-c5cd-4e34-b778-7ad0ada0e24e	fw_opening_practice_feelings	Write a Feelings Reflection	\N	Practice writing a specific feelings reflection using client details.	t	\N	2025-11-25 00:49:03.132255+00	2025-11-25 00:49:03.132255+00	\N	5be169a2-1769-427c-9145-504e80f9a958	2	\N	typeform	\N	bd855d34-6de2-48dc-b980-6b56f9131484	practice	fundamentals	\n## PRACTICE LOOP 1: Apply the Rule\n\n**Active Learning Tactic:** Give them the rule, have them apply it to examples\n\n### Monica's Scenario:\n"Alexia just told you about her ex Paul ghosting her after 3 dates. She said she's been 'a hermit' for the past year, and she's afraid to put herself back out there. She wants to find a healthy relationship."\n\n### Monica's Question:\n"Write a feelings reflection for Alexia. Use her specific details."\n\n**Student types their answer**\n\n### Evaluation Criteria:\n- ✅ Includes "Paul" by name\n- ✅ Includes "hermit" (her word)\n- ✅ References specific situation (ghosting after 3 dates)\n- ✅ Names her specific fear (putting herself back out there)\n\n### Example Strong Answer:\n"I know how discouraging it's been putting yourself out there after being a hermit for so long - finally getting the courage to go on those dates with Paul, feeling like things were going well, and then having him ghost you out of nowhere. That kind of rejection after being vulnerable is crushing."\n\n### Feedback:\n- If missing name: "Don't forget to use Paul's name - that shows you were listening!"\n- If missing "hermit": "She called herself a 'hermit' - using her exact words builds connection"\n- If too generic: "Let's be more specific. What exactly happened with Paul that hurt?"\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
5f24ae50-3506-4df3-9f1f-2f58363843a3	getting_started_02	The Session Review	01KAWND4A11KAP32W5QDHVYNB8	Watch NBG in action with Kerry and identify what makes it effective.	t	\N	2025-11-25 04:14:21.639542+00	2025-11-25 04:14:21.639542+00	\N	0e0bef5d-c90c-447a-9100-1f1ce78882ba	1	jkjT4Yh1	typeform	\N	a49f7952-3544-4c80-88b1-9be4a4e4e92c	practice	fundamentals	Activity 2: Practice with Kerry (typeform with video)\nInternal Name: getting_started_kerry_practice\nDisplay Name: "Spotting Good NBG"\nLoop Type: practice\nActivity Type: typeform\nContent:\nmarkdown## Recognizing Effective NBG\n\n### Meet Kerry\n\n**Video: Kerry introduces herself**\n"Hi, I'm Kerry. I'm 36, I'm a pediatric nurse, and... four months ago I found out my husband Derek was having an affair. We're trying to work through it, but honestly? I don't know if I can ever trust him again. I'm exhausted from constantly checking his phone, tracking where he is. I just need to know if we can really rebuild from this, or if I'm wasting my time."\n\n**Cut to Monica**\n"Kerry just finished her first session with a coach. They talked about the affair, the surveillance mode she's living in, and her fear that she can't make the right decision. Now watch what happens at the end of the session..."\n\n---\n\n### Scenario 1: Future Work\n\n**Video: Coach delivers Future Work**\n"Kerry, what we've uncovered today is really important. The constant checking - his phone, his location, spiraling when he's late - that's not really about whether Derek is trustworthy. It's about whether YOU can feel safe again. And I know how exhausting that's been - that pit in your stomach every time he's 30 minutes late, feeling terrible after checking his phone even when you find nothing. You want to know if trust can actually be rebuilt, or if you're just prolonging something that's already broken.\n\nSo here's what our work together will look like going forward: First, we need to figure out what trust rebuilding actually looks like for you - not what your family or church says, but what YOU need to feel safe. Then, we'll work on managing those triggers without spiraling into surveillance mode every time something feels off. And finally, we'll help you get clarity on whether staying is right for you, so you can make a decision you feel confident about - not one driven by exhaustion or pressure.\n\nI know how much it matters to you to make the right choice for yourself and your kids - not to waste more time if this can't be fixed, but also not to give up on something salvageable. I'm here to support you every step of the way, and I'm confident we can get you that clarity. How does that sound?"\n\n**Cut to Monica**\n"Okay, let's break down what just happened. What did the coach do FIRST in Future Work?"\n\n**Multiple Choice:**\n- A) Jumped straight into the 3-point plan\n- B) Summarized what they uncovered in the session\n- C) Asked Kerry what she wanted to work on\n- D) Started booking the next session\n\n**Correct Answer:** B\n\n**Monica's Explanation:**\n"EXACTLY! The coach started with a summary - pulling together everything from the session into one clear insight. This creates the perfect foundation for the Game Plan. It shows Kerry 'I was listening, I understand what's really going on.'"\n\n---\n\n### Monica's Question #2:\n"What made the coach's language feel personal to Kerry versus generic?"\n\n**Multiple Choice:**\n- A) They used her name throughout\n- B) They referenced specific details: Derek, the phone checking, the 30-minutes-late incident, her church\n- C) They spoke slowly and clearly\n- D) They asked if she understood\n\n**Correct Answer:** B\n\n**Monica's Explanation:**\n"YES! Specificity builds connection. When the coach mentioned Derek by name, referenced the exact 30-minute incident, brought up the phone checking and her church's pressure - Kerry hears HERSELF in the coach's words. That's what makes clients feel truly understood."\n\n---\n\n### Monica's Question #3:\n"The coach said 'First... Then... And finally...' when describing the 3 points. Why does organization matter?"\n\n**Multiple Choice:**\n- A) It doesn't - clients just care about the content\n- B) It makes the plan feel random and overwhelming\n- C) It helps clients see how the steps connect and build on each other\n- D) It's just a stylistic choice\n\n**Correct Answer:** C\n\n**Monica's Explanation:**\n"EXACTLY! When you organize your 3 points with a clear relationship - like First → Then → Finally - clients can follow the logic. They see how each step leads naturally to the next. Without organization, it just sounds like a random list."\n\n---\n\n### Scenario 2: Booking\n\n**Video: Coach transitions to booking**\n"Wonderful, Kerry - I'm really looking forward to working through this with you. Let's go ahead and get our next session in the books. I want to see you early next week so we can start figuring out what trust rebuilding looks like for you specifically - before you have another moment like that 30-minutes-late incident where you spiral. Does Monday, Tuesday, or Wednesday work better for you?"\n\n**Kerry:** "Um... I'm not sure. I need to check my schedule, work has been really unpredictable."\n\n**Coach:** "I totally understand - schedules can be hectic. Let's do this: let's just put something in the books since my schedule fills up pretty quickly, and we can always move it if you need to once you check your calendar. That way we at least have something secured. Does Tuesday or Wednesday generally work better for you?"\n\n**Kerry:** "Tuesday is usually better."\n\n**Coach:** "Perfect! On Tuesday I have 10am, 2pm, and 5pm available. What time works best for your schedule?"\n\n**Kerry:** "2pm should work."\n\n**Coach:** "Excellent - I've got you locked in for Tuesday at 2pm."\n\n**Cut to Monica**\n\n---\n\n### Monica's Question #4:\n"Kerry hesitated about her schedule. What did the coach do?"\n\n**Multiple Choice:**\n- A) Gave up and said "just let me know when you can"\n- B) Pressured her to book immediately\n- C) Offered a placeholder that can be moved if needed\n- D) Sent a calendar link\n\n**Correct Answer:** C\n\n**Monica's Explanation:**\n"YES! The placeholder strategy is GOLD. When clients hesitate, you don't give up - you book something flexible. Once it's on their calendar, they're much more likely to keep it or reschedule than to completely ghost you."\n\n---\n\n### Monica's Question #5:\n"Notice the coach's rationale for booking next week: 'before you have another moment like that 30-minutes-late incident.' Why does specific rationale matter?"\n\n**Multiple Choice:**\n- A) It doesn't - timing is timing\n- B) Generic phrases like 'keep momentum going' work just as well  \n- C) Specific rationale ties booking to her actual urgent need, making the timing feel necessary\n- D) It just sounds more professional\n\n**Correct Answer:** C\n\n**Monica's Explanation:**\n"EXACTLY! 'Keep momentum going' is vague and forgettable. But 'before you have another spiral moment' connects directly to Kerry's pain. It makes booking now feel relevant and necessary, not arbitrary."\n\n---\n\n### What You've Learned\n\n**Monica's Summary:**\n"You just saw effective NBG in action:\n- Future Work that feels personal and specific\n- Organized 3-point plan with 'we' language\n- Booking with specific rationale tied to urgent need\n- Placeholder strategy when client hesitates\n\nNow you're ready to try it yourself with Kerry - first with help, then on your own."\n\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
