e9783d78-ac0f-43f4-84de-0008eeedfee7	fw_gameplan_intro_why_three	Why Exactly 3 Points?	\N	Discover why 3 points is the magic number for Game Plans.	t	\N	2025-11-25 02:38:38.020446+00	2025-11-25 02:38:38.020446+00	\N	5be169a2-1769-427c-9145-504e80f9a958	0	\N	typeform	\N	97cd0673-f280-426d-a784-6bd039d5e6ac	introduce	fundamentals	\n## INTRODUCE LOOP 1: Discovering "Why 3?"\n\n**Active Learning Tactic:** Approximation with feedback\n\n### Monica's Setup:\n"Watch these three coaches present their game plans. Which one will the client actually REMEMBER and commit to?"\n\n### Video Clip A: 1 Point\n*Coach:* "So we're going to work on your boundaries with Jake."\n*Client:* "Okay... is that it?"\n\n### Video Clip B: 3 Points (Organized)\n*Coach:* "We'll work on three things: First, establishing clear boundaries with Jake. Then, rebuilding your confidence in communication. And finally, addressing the self-blame pattern driving this. These three pieces work together to get you to feeling secure in your relationship."\n*Client:* "Okay yes, that makes sense!"\n\n### Video Clip C: 6 Points (Overwhelming)\n*Coach:* "So we'll work on boundaries, communication, self-esteem, past trauma, your relationship with your mom, your friendship patterns..."\n*Client:* [glazed look] "Uh... that's a lot..."\n\n### Monica's Question:\n"Rank these from MOST LIKELY to lead to booking (1) to LEAST LIKELY (3)."\n\n**Correct Answer:** B → A → C\n\n### Monica's Explanation:\n"ONE point feels thin - like 'is that really worth more sessions?' SIX points feels overwhelming - 'I can't even remember all that.' THREE points hits the sweet spot: shows depth and structure without overload. That's why we ALWAYS do exactly 3."\n\n### Key Learning:\n- 1 point = feels thin, doesn't justify more sessions\n- 3 points = memorable, shows depth, feels achievable\n- 6+ points = overwhelming, client can't track it all\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
2551838d-f111-4dc9-a11f-15a7ceb6cbc5	fw_gameplan_intro_organization	Organizing Your 3 Points	\N	Learn how to organize your 3 points with clear relationships.	t	\N	2025-11-25 02:38:38.020446+00	2025-11-25 02:38:38.020446+00	\N	5be169a2-1769-427c-9145-504e80f9a958	1	\N	typeform	\N	97cd0673-f280-426d-a784-6bd039d5e6ac	introduce	fundamentals	\n## INTRODUCE LOOP 2: Organization Discovery\n\n**Active Learning Tactic:** Give examples, extract the principle\n\n### Monica's Setup:\n"All three of these coaches gave 3 points. But one of these game plans will feel WAY more compelling. Which one?"\n\n### Coach A (No Organization):\n"We'll work on your dating confidence, your boundaries with your ex, and your attachment patterns."\n\n### Coach B (Sequential Organization):\n"FIRST, we'll establish boundaries with your ex so you can stop getting pulled back in. THEN, once those boundaries protect your recovery, we'll work on rebuilding your dating confidence. And FINALLY, we'll address the attachment patterns so this doesn't repeat in your next relationship."\n\n### Coach C (Complementary Organization):\n"We'll work on three complementary areas: boundaries to protect your progress, dating confidence to get you back out there, and attachment work to ensure long-term success. Each of these supports your goal of finding a healthy relationship in a different way."\n\n### Monica's Question:\n"Which game plan feels most organized and compelling?"\n\n### Monica's Teaching:\n"YES! B shows SEQUENCE - one step leads to the next. C shows CONNECTION - how each piece supports the goal. Both work! The key is your 3 points can't just be a random list - they need RELATIONSHIP to each other."\n\n### Organization Options:\n1. **First → Then → Last** (sequential steps)\n2. **Short Term → Medium Term → Long Term** (timeline)\n3. **Surface → Digging Deeper** (increasing depth)\n4. **Immediate → Medium → Big Picture** (zooming out)\n5. **Complementary** (explain how each supports the goal differently)\n