5cbd92ff-d800-4bc9-9e5a-eb70e9aafaa2	fw_gameplan_intro_we_language	Partnership vs Solo Homework	\N	Discover why "we" language drives booking and "you" language kills it.	t	\N	2025-11-25 02:38:38.020446+00	2025-11-25 02:38:38.020446+00	\N	5be169a2-1769-427c-9145-504e80f9a958	2	\N	typeform	\N	97cd0673-f280-426d-a784-6bd039d5e6ac	introduce	fundamentals	\n## INTRODUCE LOOP 3: "We" Language Discovery\n\n**Active Learning Tactic:** Side-by-side comparison, find the difference\n\n### Monica shows two game plans for same client:\n\n### Coach 1:\n"You'll need to work on setting boundaries. You can start exploring what you want in a relationship. You should figure out how to communicate your needs."\n\n### Coach 2:\n"We'll work together on setting those boundaries so you feel protected. We're going to explore what you really want in a relationship and get you that clarity. We'll figure out how to communicate your needs in a way that feels authentic to you."\n\n### Monica's Question:\n"One of these coaches will get the booking. One probably won't. Which one books the client?"\n\n**Answer:** Coach 2\n\n### Monica's Teaching:\n"EXACTLY! Coach 1 sounds like they're giving homework. Coach 2 sounds like they're IN IT with the client. When you use 'we' language, clients understand that your continued involvement is PART OF THE PLAN. That's what drives booking."\n\n### The Rule:\n- ❌ "You'll need to..." → Solo homework framing\n- ❌ "You can start..." → Optional, client-driven\n- ❌ "You should..." → Advice, not partnership\n- ✅ "We'll work on..." → Collaborative\n- ✅ "We're going to..." → Presumptive partnership\n- ✅ "We'll figure out..." → Together\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
70680485-95ae-4abf-8daa-2be54b241470	fw_gameplan_practice_create	Create a 3-Point Game Plan	\N	Practice creating an organized, "we"-language Game Plan.	t	\N	2025-11-25 02:38:38.020446+00	2025-11-25 02:38:38.020446+00	\N	5be169a2-1769-427c-9145-504e80f9a958	3	\N	typeform	\N	97cd0673-f280-426d-a784-6bd039d5e6ac	practice	fundamentals	\n## PRACTICE LOOP 1: Build Organized 3-Point Plan\n\n**Less guidance - must recall structure rules**\n\n### Monica's Scenario:\n"Client Sarah wants to stop going back to her toxic ex. She keeps texting him when she's lonely. Her goal is to fully move on and be ready for someone healthy."\n\n### Monica's Question:\n"Create a 3-point Game Plan for Sarah. Remember: they need to be organized AND use 'we' language."\n\n### Evaluation Criteria:\n- Uses "we'll" or "we're going to" (not "you'll") ✅\n- Point 1 addresses most immediate issue (the texting) ✅\n- 3 points have clear relationship (sequence or complementary) ✅\n- All points tie to her goal (moving on, being ready) ✅\n\n### Example Strong Answer:\n"First, we'll establish the boundaries you need with him - what contact is and isn't okay - and figure out strategies for when that urge to text hits. Then, once those boundaries are protecting your recovery, we'll work on filling those lonely moments with healthier patterns so you're not reaching for your phone. And finally, we'll address why you keep going back - the attachment patterns driving this cycle - so when you meet someone new, this doesn't repeat."\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
a5e7a8b0-484e-4447-ab43-e9cb3435d8a7	fw_gameplan_assess	Game Plan Assessment	\N	Build a complete Game Plan with no guidance - real-world conditions.	t	\N	2025-11-25 02:38:38.020446+00	2025-11-25 02:38:38.020446+00	\N	5be169a2-1769-427c-9145-504e80f9a958	5	\N	typeform	\N	97cd0673-f280-426d-a784-6bd039d5e6ac	assess	fundamentals	\n## ASSESS LOOP: Build Complete Game Plan\n\n**Real-world conditions, no guidance**\n\n### Monica's Scenario:\n"Client Emma just broke up with her boyfriend of 5 years. She's devastated and wants to 'understand what went wrong' so she doesn't 'waste another 5 years.' Her goal is to heal and eventually find a better relationship."\n\n### Monica's Task:\n"Write your complete 3-point Game Plan for Emma. Make sure it's organized, uses 'we' language, and starts with most urgent."\n\n**No hints. No structure. No examples.**\n\n### Evaluation Rubric:\n- Exactly 3 points\n- Clear organization (sequential OR complementary with explanation)\n- Consistent "we" language throughout\n- Point 1 addresses most immediate need\n- All points tie directly to her specific goal\n- Uses Emma's language ("understand what went wrong," "waste another 5 years")\n\n### Example Strong Answer:\n"Based on everything we discussed, here's what we'll work on together:\n\nFirst, we're going to help you process this breakup and understand what actually went wrong - not to blame yourself, but to get the clarity you need so you're not carrying confusion into your next chapter.\n\nThen, once you have that understanding, we'll work on healing - moving through the grief, rebuilding your sense of self outside of that relationship, and getting to a place where you feel whole on your own.\n\nAnd finally, we'll make sure you're set up for success in your next relationship - identifying what you actually need in a partner, recognizing red flags earlier, and building the confidence to walk away if something isn't right so you never waste another 5 years."\n	\N	\N	\N	https://cjwhhjhwheckbbb