85531e66-db8f-4027-a62e-a0b19e2a9e54	fw_close_intro_buyin	The Buy-In Phrase	\N	Discover the exact phrase that gets client commitment.	t	\N	2025-11-25 02:38:38.020446+00	2025-11-25 02:38:38.020446+00	\N	5be169a2-1769-427c-9145-504e80f9a958	0	\N	typeform	\N	620754ff-80bf-42a4-804b-cd463565cc86	introduce	fundamentals	\n## INTRODUCE LOOP: The Magic Phrase\n\n**Active Learning Tactic:** Socratic String (guessable answers building on each other)\n\n### Monica's Setup:\n"You just delivered your Game Plan. Now you need the client to verbally commit before moving to booking. Watch these four coaches."\n\n### Coach A:\n"What do you think about that plan?"\n*Client:* "Um... I mean, I guess it makes sense..." [hesitant]\n\n### Coach B:\n"Does that sound good to you?"\n*Client:* "I don't know, maybe..." [uncertain]\n\n### Coach C:\n"How does that sound?"\n*Client:* "Yeah, that sounds great!" [confident]\n\n### Coach D:\n[Says nothing, just moves to booking]\n*Client:* [confused] "Wait, so...?"\n\n### Monica's Question:\n"Which coach got the clearest YES?"\n\n**Answer:** Coach C\n\n### Monica's Next Question:\n"What exact phrase did Coach C use?"\n\n**Fill in the blank:** "How _____ _____ _____?"\n\n**Answer:** "does that sound"\n\n### Monica's Teaching:\n"PERFECT! 'How does that sound?' is your magic phrase. It's confident but casual. It invites confirmation without inviting debate. Say this EXACT phrase after every Game Plan."\n\n### The Rule:\nAlways "How does that sound?" - nothing else.\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
