db818b06-8b52-4b8b-94e2-fd75b1089ace	bk_flow_intro_sequence	The 5-Step Booking Sequence	\N	Learn the correct order of the 5 booking steps.	t	\N	2025-11-25 02:44:31.866927+00	2025-11-25 02:44:31.866927+00	\N	3a79e660-68c9-4c48-9587-2cb8e5ca34bc	0	\N	typeform	\N	8c4d287f-53e4-49a9-a0d2-66edfef612b7	introduce	fundamentals	\n## INTRODUCE LOOP 1: Discovering the Sequence\n\n**Active Learning Tactic:** Put steps in correct order (puzzle)\n\n### Monica's Setup:\n"Booking has 5 specific steps that happen in order. Watch this successful booking, then put the steps in the right sequence."\n\n**[Video shows smooth booking conversation]**\n\n### Monica gives shuffled steps:\n- Share all available time slots for that day\n- Recommend broad timeframe with specific reason\n- Lock in the confirmed appointment\n- Smooth transition from Future Work\n- Ask which day works best in that timeframe\n\n### Student drags into correct order:\n\n**Correct Sequence:**\n1. Smooth transition from Future Work\n2. Recommend broad timeframe with specific reason\n3. Ask which day works best in that timeframe\n4. Share all available time slots for that day\n5. Lock in the confirmed appointment\n\n### Monica's Teaching:\n"YES! Notice how it NARROWS: Future Work → Timeframe → Day → Time → Locked. You're guiding them step-by-step so they keep saying 'yes' at each stage. Never jump straight to a specific time - that creates friction."\n\n### Why This Sequence Works:\n- Each step is a small, easy "yes"\n- Client feels guided, not pressured\n- Reduces decision fatigue\n- Creates momentum toward booking\n- Avoids "slot roulette" (suggesting times until one sticks)\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
9d955059-ba71-4cd4-9695-dad3067749f3	bk_flow_intro_rationale	Specific vs Vague Rationale	\N	Discover why specific rationale creates urgency and vague rationale loses bookings.	t	\N	2025-11-25 02:44:31.866927+00	2025-11-25 02:44:31.866927+00	\N	3a79e660-68c9-4c48-9587-2cb8e5ca34bc	1	\N	typeform	\N	8c4d287f-53e4-49a9-a0d2-66edfef612b7	introduce	fundamentals	\n## INTRODUCE LOOP 2: Specific vs Vague Rationale\n\n**Active Learning Tactic:** Compare examples, extract rule\n\n### Monica's Setup:\n"Both coaches recommend booking 'early next week.' But one will get the booking, one probably won't."\n\n### Coach A (Vague):\n"Let's get you in early next week to keep momentum going."\n\n### Coach B (Specific):\n"Let's get you in early next week so we can craft that message to Paul while everything from today is still fresh and you're feeling clear about what you want to say."\n\n### Monica's Question:\n"Which rationale makes the timing feel MORE urgent and necessary?"\n\n**Answer:** Coach B\n\n### Monica's Follow-Up:\n"What makes Coach B's rationale stronger? What did they include?"\n\n### Discovery by highlighting:\n- References specific client (Paul)\n- References specific Future Work item (crafting message)\n- Explains why THIS timing matters (while things are fresh)\n- Connects to client's actual situation\n\n### Monica's Teaching:\n"See that? Coach B doesn't just say 'momentum' - they name the EXACT thing you'll work on and WHY next week makes sense for THAT specific work. Specific rationale = urgency. Vague rationale = 'I'll think about it.'"\n\n### Vague Rationales to AVOID:\n- "to keep momentum going"\n- "while everything's fresh"\n- "before too much time passes"\n- "so we can keep making progress"\n\n### Specific Rationales that WORK:\n- "so we can craft that message to Paul before you see him Saturday"\n- "so we can prep you for that conversation with Jake at his birthday party"\n- "so we can finalize your boundaries before Thanksgiving dinner"\n	\N	\N	\N	https://cjwh