eb8fc805-943b-423a-9290-a635f446289f	bk_flow_intro_transition	The Booking Transition	\N	Learn the exact language for transitioning from Future Work to Booking.	t	\N	2025-11-25 02:44:31.866927+00	2025-11-25 02:44:31.866927+00	\N	3a79e660-68c9-4c48-9587-2cb8e5ca34bc	2	\N	typeform	\N	8c4d287f-53e4-49a9-a0d2-66edfef612b7	introduce	fundamentals	\n## INTRODUCE LOOP 3: Transition Language\n\n**Active Learning Tactic:** Compare and identify the winning phrase\n\n### Monica's Setup:\n"The client just said 'Yes, that sounds great!' to your Future Work. Watch how these coaches transition into booking."\n\n### Coach A (Weak):\n"So... do you want to book another session?"\n*Client:* "Um, let me think about it..."\n\n### Coach B (Weak):\n"Should we look at scheduling something?"\n*Client:* "Maybe, I need to check my calendar..."\n\n### Coach C (Strong):\n"Great, I'm looking forward to continuing our work together, Alexia. Let's go ahead and get our next session in the books."\n*Client:* "Okay, sounds good!"\n\n### Monica's Question:\n"Which transition kept the momentum going?"\n\n**Answer:** Coach C\n\n### Monica's Analysis:\n"What did Coach C do differently?"\n\n**Coach A & B:**\n- Asked permission ("do you want to?" / "should we?")\n- Created a decision point\n- Invited hesitation\n\n**Coach C:**\n- Acknowledged buy-in warmly\n- Used presumptive language ("Let's go ahead")\n- Used client's name\n- Made booking the natural next step\n\n### The Formula:\n"[Acknowledgment], [Name]. Let's go ahead and get our next session in the books."\n\n### Examples:\n- "Great, I'm looking forward to continuing our work together, Alexia. Let's go ahead and get our next session in the books."\n- "Perfect! I'm excited to work on this with you, Jake. Let's get our next appointment scheduled."\n- "Wonderful - I'm really glad we're doing this together, Sarah. Let's lock in our next session."\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	ht