28a6ea09-5db8-4467-95df-80db36731728	bk_placeholder_intro	The Placeholder Strategy	\N	Learn how to handle client hesitation with the placeholder approach.	t	\N	2025-11-25 02:44:31.866927+00	2025-11-25 02:44:31.866927+00	\N	3a79e660-68c9-4c48-9587-2cb8e5ca34bc	0	\N	typeform	\N	35b5ead7-fca1-449b-9e35-88e1b6dc121d	introduce	fundamentals	\n## INTRODUCE LOOP: The Placeholder Strategy\n\n**Active Learning Tactic:** Watch scenario, identify solution\n\n### Monica's Setup:\n"Watch what happens when a client hesitates..."\n\n### Scenario A - Coach Gives Up:\n**Coach:** "Which day next week works best?"\n**Client:** "Um... I'm not sure. I need to check my schedule."\n**Coach:** "Oh okay. Just let me know when you figure it out!"\n*[Call ends. Client never books.]*\n\n### Monica: "Uh oh. What just happened?"\n\n### Scenario B - Coach Uses Placeholder:\n**Coach:** "Which day next week works best?"\n**Client:** "Um... I'm not sure. I need to check my schedule."\n**Coach:** "I totally understand. Let's do this - let's just put something in the books since my schedule fills up quickly, and we can always move it if something comes up. That way we at least have something secured. Does Tuesday or Wednesday generally work better for you?"\n**Client:** "Wednesday is usually better."\n**Coach:** "Perfect! Wednesday I have 11am, 2pm, and 5pm. Let's pencil you in for one of those..."\n*[Client books!]*\n\n### Monica's Question:\n"What did the second coach do differently?"\n\n**Multiple choice:**\n- A) Gave up and let the client think about it\n- B) Pressured the client to book immediately\n- C) Offered a placeholder that can be moved\n- D) Sent a calendar link\n\n**Answer:** C\n\n### Monica's Teaching:\n"EXACTLY! The placeholder strategy is your secret weapon. When someone hesitates, you don't give up - you book something flexible. Once it's on their calendar, they're MUCH more likely to keep it or reschedule than to completely ghost you."\n\n### The Placeholder Script:\n"I totally understand. Let's do this - let's just put something in the books since my schedule fills up quickly, and we can always move it if something comes up. That way we at least have something secured."\n\n### Why Placeholders Work:\n- Converts uncertainty into concrete action\n- Preserves momentum (once session ends without booking, follow-through drops dramatically)\n- Clients are more likely to keep/reschedule than proactively reach out later\n- Reduces mental burden on client\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
eead9b75-e1bb-4283-9470-5a105b118ea9	bk_placeholder_practice	Handle Schedule Hesitation	\N	Practice responding to client hesitation with the placeholder strategy.	t	\N	2025-11-25 02:44:31.866927+00	2025-11-25 02:44:31.866927+00	\N	3a79e660-68c9-4c48-9587-2cb8e5ca34bc	1	\N	typeform	\N	35b5ead7-fca1-449b-9e35-88e1b6dc121d	practice	fundamentals	\n## PRACTICE LOOP: Handle Hesitation\n\n### Monica's Scenario:\n"You just asked Marcus which day works best. He says: 'I'm not really sure... my work schedule has been crazy.'"\n\n### Monica's Question:\n"What do you say next? Type your response."\n\n**Student types placeholder offer**\n\n### Auto-Check:\n- Acknowledges concern without backing down ✅\n- Offers placeholder that can be moved ✅\n- Continues booking process (asks for general day preference) ✅\n- Maintains presumptive momentum ✅\n\n### Example Strong Answer:\n"I totally understand - schedules can be hectic. Let's do this: let's just put something in the books since my schedule fills up pretty quickly, and we can always move it if you need to once you check your calendar. Does Thursday or Friday generally work better for you?"\n\n### Common Mistakes:\n❌ "Okay, just let me know when you figure it out" (giving up)\n❌ "You really should book now before I fill up" (pressure)\n❌ "Here's my calendar link, book when you can" (offloading)\n❌ "Do you want to just think about it?" (inviting no)\n\n### The Key Elements:\n1. Acknowledge: "I totally understand"\n2. Reframe: "Let's just put something in the books"\n3. Reassure: "We can always move it"\n4. Continue: "Does [day] or [day] generally work better?"\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
