y I have 11am, 3pm, and 6pm. What time would generally fit your schedule best?"\n\n**David:** "3pm should be okay."\n\n**Lock-in:** "Great - I've got you penciled in for Thursday at 3pm. If anything changes with work, just let me know and we'll move it around. But at least now we're set to get you ready before the weekend."\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
4fdbb6ba-460b-4d7a-ab7b-6d74b026057f	pu_recommend_intro_one	One Plan vs Menu Dump	\N	Discover why recommending ONE plan beats presenting multiple options.	t	\N	2025-11-25 02:47:49.80848+00	2025-11-25 02:47:49.80848+00	\N	9d035689-52bf-49a1-9f45-ad1b97429aa8	0	\N	typeform	\N	bead7190-f196-4cc9-8d9c-11b98ed29a71	introduce	fundamentals	\n## INTRODUCE LOOP 1: One Plan vs Menu Dump\n\n**Active Learning Tactic:** Show consequences of each approach\n\n### Monica's Setup:\n"Both coaches need to present their packages. Watch what happens..."\n\n### Coach A (Menu Dump):\n"So we have a 5-session package for $900, a 10-session package for $1,650, and a 20-session package for $2,400. Which one sounds good to you?"\n*Client:* "Um... I don't know... that's a lot to think about..." [overwhelmed, delays decision]\n\n### Coach B (One Recommendation):\n"Based on the work we outlined - figuring out your boundaries with Jake, rebuilding communication confidence, and addressing that self-blame pattern - I recommend the 20-session package. This gives us the runway to tackle all three areas thoroughly. Sessions come out to $120/hour compared to $180 for single sessions. How does that sound?"\n*Client:* "Okay, that makes sense."\n\n### Monica's Question:\n"Which client is more likely to purchase?"\n\n**Answer:** Coach B's client\n\n### Monica's Analysis:\n"What did Coach A do that created overwhelm?"\n**Students identify:** Gave 3 options at once\n\n"What did Coach B do instead?"\n**Students identify:** Made ONE recommendation with clear reason\n\n### Monica's Teaching:\n"YES! Choice paralysis is real. When you give multiple options, the client has to COMPARE them - that's cognitive work that creates friction. One clear recommendation with rationale = simple decision. They just have to say yes or no to what you're suggesting."\n\n### The Rule:\n- ❌ Never present multiple packages at once\n- ❌ Never ask "which one do you want?"\n- ✅ Recommend ONE specific plan\n- ✅ Tie recommendation to their Future Work\n- ✅ Explain why THIS plan fits THEIR situation\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
48107f6c-b22e-4117-bc28-d976d22f3b8a	pu_recommend_intro_largest	Why Default to Largest Package	\N	Understand why the largest package is usually the right recommendation.	t	\N	2025-11-25 02:47:49.80848+00	2025-11-25 02:47:49.80848+00	\N	9d035689-52bf-49a1-9f45-ad1b97429aa8	1	\N	typeform	\N	bead7190-f196-4cc9-8d9c-11b98ed29a71	introduce	fundamentals	\n## INTRODUCE LOOP 2: Default to Largest Package\n\n**Active Learning Tactic:** Reasoning through scenarios\n\n### Monica's Setup:\n"Here's a question that trips up a lot of coaches: If a client seems like they could benefit from any package, which should you recommend?"\n\n### Monica's Question:\n"A new client just had a great first session. They're motivated and engaged. You have 5, 10, and 20-session packages. Which do you recommend?"\n\n**Choices:**\n- A) 5 sessions - don't want to overwhelm them\n- B) 10 sessions - nice middle ground\n- C) 20 sessions - give them what they need\n\n**Correct Answer:** C\n\n### Monica's Explanation:\n"Here's the business reality that new coaches often miss:\n\n**Clients are most likely to purchase when they're coming out of a great first session.** That's peak buying energy. If you recommend something smaller 'just in case,' you're leaving value on the table.\n\n**Longer packages = more time to provide value = higher retention.** With 20 sessions, you have runway to build rapport, handle setbacks, and see real transformation. With 5 sessions? You barely get started.\n\n**You can always explain why it's NOT the largest if that's true.** 'Normally I'd recommend our 20-session package, but based on [specific reason], I think 10 sessions makes more sense for you.' This actually builds rapport because it shows thoughtful tailoring."\n\n### The Principle:\nDefault to largest UNLESS there's a clear reason not to. And if you're NOT recommending the largest, mention it and explain why.\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	ht