eneric vs Specific:\n❌ "You'll get more value with more sessions"\n❌ "This package has the best discount"\n❌ "More sessions = more progress"\n\n✅ "Based on [Point 1], [Point 2], and [Point 3]..."\n✅ "This gives us runway to work through [specific goals]"\n✅ "You'll need support as [specific situation unfolds]"\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
