de2d810e-c011-46a7-9ffb-b8f97b1b5764	pu_value_intro_hourly	Hourly Rate vs Total Price	\N	Learn why focusing on hourly rate converts better than total price.	t	\N	2025-11-25 02:47:49.80848+00	2025-11-25 02:47:49.80848+00	\N	9d035689-52bf-49a1-9f45-ad1b97429aa8	0	\N	typeform	\N	a5c9ebc5-1d46-4c08-a0d9-f24f43b2ab59	introduce	fundamentals	\n## INTRODUCE LOOP 1: Hourly Rate vs Total Price\n\n**Active Learning Tactic:** Comparison with feedback\n\n### Monica's Setup:\n"Same package, different framing. Which one makes you more likely to say yes?"\n\n### Coach A (Total Price):\n"The 20-session package costs $2,400 total."\n*Client:* [eyes widen] "Oh... that's... a lot..."\n\n### Coach B (Hourly Rate):\n"With the 20-session package, sessions come out to $120 per hour, compared to $180 for single sessions - so you're saving $60 every time we meet."\n*Client:* "Oh, that's a good deal!"\n\n### Monica's Question:\n"Which framing made the price feel MORE manageable?"\n\n**Answer:** Coach B\n\n### Monica's Analysis:\n"Why does the hourly rate feel better than the total?"\n\n**Discovery:**\n- $2,400 sounds BIG and scary\n- $120/hour sounds like a session price (normal)\n- Comparing to $180 shows clear VALUE\n- Client focuses on immediate per-session cost, not cumulative total\n\n### Monica's Teaching:\n"Here's a critical business insight: Many of your best long-term clients - people who've spent $10,000+ with you - would NEVER have started if you led with the total price. They continued because the pacing was palatable.\n\nThis isn't misleading - you'll gladly share total if they ask. But leading with it scares people off before they understand the value.\n\nSince you genuinely believe coaching will help them, framing pricing in a way that makes them MORE likely to continue is actually serving them, not doing them a disservice."\n\n### The Formula:\n"With this package, sessions come out to $[X] per hour, compared to $[Y] for single sessions - so you're saving $[difference] every session."\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
