your ex texts or when someone new triggers old patterns."\n\n**Value:**\n"With this package, sessions come out to $120/hour compared to $200 for single sessions - you're saving $80 every time we meet."\n\n**Close:**\n"I'll go ahead and process your Coaching Plan now."\n\n**[If Devon says: "That's more than I was planning to spend..."]**\n\n**Handle Objection:**\n"I hear you on budget - that makes total sense. Let's do this: I'll give you the $120/hour rate but you can book session-by-session so there's no big upfront cost. That way you get the discounted rate without the commitment. How does that sound?"\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
a5a35493-aa30-4fa1-8782-10d7d6abe132	pu_close_intro_presumptive	The Presumptive Close	\N	Learn to close without asking permission.	t	\N	2025-11-25 02:47:49.80848+00	2025-11-25 02:47:49.80848+00	\N	9d035689-52bf-49a1-9f45-ad1b97429aa8	1	\N	typeform	\N	c097826d-63c0-4c08-9bc8-f07390b3f9b1	introduce	fundamentals	\n## INTRODUCE LOOP 2: The Exact Close\n\n**Active Learning Tactic:** Identify the magic phrase\n\n### Monica's Setup:\n"The client just confirmed their plan. Watch these different closes..."\n\n### Coach A:\n"Great! So... can I run your card now?"\n*Client:* "Um..." [creates hesitation]\n\n### Coach B:\n"Awesome! Should I charge you for that?"\n*Client:* "I guess..." [tentative]\n\n### Coach C:\n"Perfect - I'll go ahead and process your Coaching Plan now."\n*Client:* "Sounds good!" [smooth]\n\n### Monica's Question:\n"Which coach maintained momentum all the way to the end?"\n\n**Answer:** Coach C\n\n### Monica's Analysis:\n"What did Coach C say that was different?"\n\n**Fill in the blank:**\n"Perfect - I'll go ahead and _______ your _______ _______ now."\n\n**Answer:** "process your Coaching Plan"\n\n### Monica's Teaching:\n"YES! Once they confirm, you don't ASK permission to charge - they already said yes! Use presumptive language: 'I'll go ahead and process your Coaching Plan now.' Keeps it smooth and confident to the finish line."\n\n### The Formula:\n"Perfect - I'll go ahead and process your Coaching Plan now."\n\n### What NOT to say:\n❌ "Can I run your card?"\n❌ "Is it okay if I charge you?"\n❌ "Do you want me to process that?"\n❌ "Should I charge you now?"\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/character-profiles/monica-profile.png	Monica	\N	\N	f	\N
33822bb0-6899-411f-91ac-43f46724abb6	pu_close_intro_hesitation	Handling Price Hesitation	\N	Learn the 3-step process for handling price objections.	t	\N	2025-11-25 02:47:49.80848+00	2025-11-25 02:47:49.80848+00	\N	9d035689-52bf-49a1-9f45-ad1b97429aa8	2	\N	typeform	\N	c097826d-63c0-4c08-9bc8-f07390b3f9b1	introduce	fundamentals	\n## INTRODUCE LOOP 3: Handling Price Hesitation\n\n**Active Learning Tactic:** Watch approach, identify steps\n\n### Monica's Setup:\n"The client just said 'That's more than I expected to spend.' Watch how this coach handles it."\n\n### Video:\n**Client:** "That's more than I expected to spend."\n**Coach:** "I hear you on budget - that makes total sense. [STEP 1]\n\nLet's do this - I'll give you the 10-session package at the same $120/hour rate from the larger package. That gets you started with a smaller commitment but still gives us real time to work through your boundaries with Jake and start building those communication skills. [STEP 2]\n\nHow does that sound?" [STEP 3]\n\n*[Coach stops talking and waits]*\n\n### Monica's Question:\n"What are the 3 steps you saw?"\n\n**Drag to match:**\n- "I hear you on budget" → [1. Acknowledge]\n- "Let's do this - I'll give you..." → [2. Offer ONE Alternative]\n- "How does that sound?" + waiting → [3. Pause]\n\n### Monica's Teaching:\n"PERFECT! The formula is:\n1. **Acknowledge** - Briefly validate without arguing\n2. **Offer ONE alternative** - Not multiple options, just one\n3. **Pause** - Stop talking. Let them respond.\n\nThe pause is critical. Don't fill the silence with more selling. State your alternative and wait."\n\n### Important Notes:\n- Only offer ONE alternative at a time\n- If that doesn't work, offer ONE different option\n- Keep solutions practical (smaller package, payment plan, session-by-session)\n- Never give up entirely - always find a path forward\n	\N	\N	\N	https://cjwhhjhwheckbbbnryxh.supabase.co/storage/v1/object/public/haikei-waves-blue/waves-07.png	https://cjwhhjhwheckbbbnryxh.