66	2025-11-25 17:49:12.258282+00	"{\\"form_id\\":\\"jkjT4Yh1\\",\\"token\\":\\"53psul3inby9y9np53psuz4ghhucdkp7\\",\\"landed_at\\":\\"2025-11-25T17:48:52Z\\",\\"submitted_at\\":\\"2025-11-25T17:49:11Z\\",\\"hidden\\":{\\"activities_display_name\\":\\"Spotting Good NBG\\",\\"modules_title\\":\\"Getting Started\\",\\"supabase_typeform_id\\":\\"5f24ae50-3506-4df3-9f1f-2f58363843a3\\",\\"topics_title\\":\\"What is NBG?\\",\\"user_id\\":\\"3fc5a679-8233-49fd-b7fa-3a450432f2b3\\"},\\"definition\\":{\\"id\\":\\"jkjT4Yh1\\",\\"title\\":\\"getting_started_quiz_kerry_practice\\",\\"fields\\":[{\\"id\\":\\"W98jW4tGuS5B\\",\\"ref\\":\\"e475512f-d62e-4cd7-887e-a4130d668148\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"\\\\\\\\*\\\\\\\\*Video: Coach delivers Future Work\\\\\\\\*\\\\\\\\*\\\\n\\\\\\"Kerry, what we've uncovered today is really important. The constant checking - his phone, his location, spiraling when he's late - that's not really about whether Derek is trustworthy. It's about whether YOU can feel safe again. And I know how exhausting that's been - that pit in your stomach every time he's 30 minutes late, feeling terrible after checking his phone even when you find nothing. You want to know if trust can actually be rebuilt, or if you're just prolonging something that's already broken.\\\\n\\\\nSo here's what our work together will look like going forward: First, we need to figure out what trust rebuilding actually looks like for you - not what your family or church says, but what YOU need to feel safe. Then, we'll work on managing those triggers without spiraling into surveillance mode every time something feels off. And finally, we'll help you get clarity on whether staying is right for you, so you can make a decision you feel confident about - not one driven by exhaustion or pressure.\\\\n\\\\nI know how much it matters to you to make the right choice for yourself and your kids - not to waste more time if this can't be fixed, but also not to give up on something salvageable. I'm here to support you every step of the way, and I'm confident we can get you that clarity. How does that sound?\\\\\\"\\\\n\\\\n\\\\\\\\*\\\\\\\\*Cut to Monica\\\\\\\\*\\\\\\\\*\\\\n\\\\\\"Okay, let's break down what just happened. What did the coach do FIRST in Future Work?\\\\\\"\\\\n\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"onEZ4Atm5RnZ\\",\\"ref\\":\\"e86c967c-a4b2-4e12-8688-a20c30f055f0\\",\\"label\\":\\"Clients feel less committed because there's no concrete appointment anchoring their decision\\"},{\\"id\\":\\"iHuNwTSPEcQy\\",\\"ref\\":\\"c6eeaca7-cc39-488c-b943-dbd001bf2ccf\\",\\"label\\":\\"Nothing - the order doesn't really matter\\"},{\\"id\\":\\"wBkUAfqmzo4z\\",\\"ref\\":\\"f49c6fce-9114-4a9c-babe-7fa8b579d733\\",\\"label\\":\\"It's just a preference, not a rule\\"},{\\"id\\":\\"yLRu4ujryP6a\\",\\"ref\\":\\"c72470d8-d195-401a-8efb-3bad8260ba72\\",\\"label\\":\\"Booking first is just tradition\\"}]},{\\"id\\":\\"i9D1Pvl3aXdD\\",\\"ref\\":\\"8307bd9d-e600-4de8-9f8d-b0353268451a\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"What made the coach's language feel personal to Kerry versus generic?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"cPEVtUocb6uJ\\",\\"ref\\":\\"f2e7fade-bc3d-42aa-94eb-4e791a2b0029\\",\\"label\\":\\"With 10-15 minutes remaining in the session\\"},{\\"id\\":\\"pLWgf6ZE2beG\\",\\"ref\\":\\"f59361fd-e251-408b-90b6-fdf0496389a2\\",\\"label\\":\\"Right at the beginning to set expectations\\"},{\\"id\\":\\"d02wFlwjjTwP\\",\\"ref\\":\\"3ad656a9-e39d-41fb-af1a-0a1ea48a5c3a\\",\\"label\\":\\"Whenever the client brings it up\\"},{\\"id\\":\\"Wg1gkzOzvoXX\\",\\"ref\\":\\"3eeb81e5-a672-4deb-b597-0c955cf37d13\\",\\"label\\":\\"After they ask about next steps\\"}]},{\\"id\\":\\"k5J7Eohu20Z9\\",\\"ref\\":\\"abaed99d-847e-45ad-97fc-32f3f739dca6\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"Coach Daniel said 'First... Then... And finally...' when describing the 3 points. Why does organization matter?\\\\\\"\\