"c72470d8-d195-401a-8efb-3bad8260ba72\\",\\"label\\":\\"All three work — the sequence matters less than the coach's warmth and authenticity\\"},{\\"id\\":\\"PQtCuIQsNX47\\",\\"ref\\":\\"140fceb2-4909-4ceb-9852-8ec8c49bd0f4\\",\\"label\\":\\"Session A is too long — clients prefer efficiency; B and C respect their time better\\"}]},{\\"id\\":\\"LCM7lwOd8b1K\\",\\"ref\\":\\"8307bd9d-e600-4de8-9f8d-b0353268451a\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"{{var:health_text}}\\\\n\\\\nWhat's Version B doing that Version A isn't?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"xMrd3mxuA0xU\\",\\"ref\\":\\"f2e7fade-bc3d-42aa-94eb-4e791a2b0029\\",\\"label\\":\\"Version B has three parts — Opening (recap + empathy), Game Plan (3 points), Close (partnership + buy-in check)\\"},{\\"id\\":\\"fKv5voUFdyjZ\\",\\"ref\\":\\"f59361fd-e251-408b-90b6-fdf0496389a2\\",\\"label\\":\\"Version B is more thorough — covering more ground shows the client you understand the full scope of their situation\\"},{\\"id\\":\\"2R8GuYS7APol\\",\\"ref\\":\\"3ad656a9-e39d-41fb-af1a-0a1ea48a5c3a\\",\\"label\\":\\"Version B builds more rapport — the warmth and empathy makes the client feel safer\\"},{\\"id\\":\\"62Y6SvmIG7po\\",\\"ref\\":\\"3eeb81e5-a672-4deb-b597-0c955cf37d13\\",\\"label\\":\\"Version B uses specific language from the session — mirroring the client's words creates connection\\"},{\\"id\\":\\"QJSqU4PR3WCm\\",\\"ref\\":\\"9e50d667-16a5-4404-9726-3b7db531b9ba\\",\\"label\\":\\"Version A is actually better for some clients — some people prefer direct and concise\\"}]},{\\"id\\":\\"qm1BIK4BW4Jf\\",\\"ref\\":\\"abaed99d-847e-45ad-97fc-32f3f739dca6\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"{{var:health_text}}\\\\n\\\\nWhich Game Plan would you remember?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"IF3PfZi3N9gq\\",\\"ref\\":\\"498862b8-99c8-4aff-85b2-b3f0dca54399\\",\\"label\\":\\"Plan A — it's comprehensive and shows the coach has expertise in multiple areas\\"},{\\"id\\