72470d8-d195-401a-8efb-3bad8260ba72\\",\\"label\\":\\"All three work — the sequence matters less than the coach's warmth and authenticity\\"},{\\"id\\":\\"PQtCuIQsNX47\\",\\"ref\\":\\"140fceb2-4909-4ceb-9852-8ec8c49bd0f4\\",\\"label\\":\\"Session A is too long — clients prefer efficiency; B and C respect their time better\\"}]},{\\"id\\":\\"LCM7lwOd8b1K\\",\\"ref\\":\\"8307bd9d-e600-4de8-9f8d-b0353268451a\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"{{var:health_text}}\\\\n\\\\nWhat's Version B doing that Version A isn't?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"xMrd3mxuA0xU\\",\\"ref\\":\\"f2e7fade-bc3d-42aa-94eb-4e791a2b0029\\",\\"label\\":\\"Version B has three parts — Opening (recap + empathy), Game Plan (3 points), Close (partnership + buy-in check)\\"},{\\"id\\":\\"fKv5voUFdyjZ\\",\\"ref\\":\\"f59361fd-e251-408b-90b6-fdf0496389a2\\",\\"label\\":\\"Version B is more thorough — covering more ground shows the client you understand the full scope of their situation\\"},{\\"id\\":\\"2R8GuYS7APol\\",\\"ref\\":\\"3ad656a9-e39d-41fb-af1a-0a1ea48a5c3a\\",\\"label\\":\\"Version B builds more rapport — the warmth and empathy makes the client feel safer\\"},{\\"id\\":\\"62Y6SvmIG7po\\",\\"ref\\":\\"3eeb81e5-a672-4deb-b597-0c955cf37d13\\",\\"label\\":\\"Version B uses specific language from the session — mirroring the client's words creates connection\\"},{\\"id\\":\\"QJSqU4PR3WCm\\",\\"ref\\":\\"9e50d667-16a5-4404-9726-3b7db531b9ba\\",\\"label\\":\\"Version A is actually better for some clients — some people prefer direct and concise\\"}]},{\\"id\\":\\"qm1BIK4BW4Jf\\",\\"ref\\":\\"abaed99d-847e-45ad-97fc-32f3f739dca6\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"{{var:health_text}}\\\\n\\\\nWhich Game Plan would you remember?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"IF3PfZi3N9gq\\",\\"ref\\":\\"498862b8-99c8-4aff-85b2-b3f0dca54399\\",\\"label\\":\\"Plan A — it's comprehensive and shows the coach has expertise in multiple areas\\"},{\\"id\\":\\"VxJl3AXlkOmR\\",\\"ref\\":\\"556a3f50-d487-4111-93c3-5f1919372a1d\\",\\"label\\":\\"Plan B — it's practical and gives the client things they can do between sessions\\"},{\\"id\\":\\"LXOMNcXhK3rb\\",\\"ref\\":\\"856a775a-06a7-439c-b380-5189491c2273\\",\\"label\\":\\"Plan C — it's three organized points in plain language, shows partnership\\"},{\\"id\\":\\"GgU9lhAi52Nx\\",\\"ref\\":\\"df38473c-ecf1-43c5-9e6a-c6704e566a4f\\",\\"label\\":\\"Plan A with fewer items — same approach, just pick the top 3 concepts\\"},{\\"id\\":\\"xl2B7yWXMb6J\\",\\"ref\\":\\"7bc7f2a2-94b8-48c9-b0a6-5721700db1d3\\",\\"label\\":\\"It depends on the client — some clients want frameworks, some want simplicity\\"}]},{\\"id\\":\\"08clYtzpgrnx\\",\\"ref\\":\\"01da3c32-2c3e-4218-8bde-c94f6b7367b1\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"{{var:health_text}}\\\\n\\\\nWhat's the difference?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"GxjCbhS8KXiU\\",\\"ref\\":\\"b25e9c03-0b96-4026-8cca-9b0ebee264e8\\",\\"label\\":\\"Version B has a specific rationale tied to her situation\\"},{\\"id\\":\\"ClbYwcogzRL6\\",\\"ref\\":\\"d8227b8c-683b-41ad-9755-d5fe4a89b6e4\\",\\"label\\":\\"Version B is presumptuous — Version A respects client autonomy by letting them decide if they want to continue\\"},{\\"id\\":\\"jxS0fpI6YTvG\\",\\"ref\\":\\"da88a4ef-7a2a-47a5-b822-500c4bf936f9\\",\\"label\\":\\"Version A is more professional — calendar links are industry standard and streamline scheduling\\"},{\\"id\\":\\"XnCN5J7u5KR2\\",\\"ref\\":\\"d45af4b9-90f3-42b5-9560-952b38392619\\",\\"label\\":\\"Both work, but B is warmer — the real difference is tone, not technique\\"},{\\"id\\":\\"3MMhSwfWJSIZ\\",\\"ref\\":\\"8327094a-58f0-4622-ab64-749e105907d4\\",\\"label\\":\\"Version A is safer — if the client isn't sure, giving them space prevents pressure\\"}]},{\\"id\\":\\"lMYDpcnbakxG\\",\\"ref\\":\\"5553a26b-b629-4a3f-af4a-54808c1faf55\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"{{var:health_text}}\\\\n\\\\nWhat's Version A missing?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"uZfZoHUzRuz0\\",\\"ref\\":\\"df630fba-31dc-420d-a4b9-3c471afc50a7\\",\\"label\\":\\"A single recommendation — Version A dumps a menu instead of guiding\\"},{\\"id\\":\\"15uPrm0quwQ9\\",\\"ref\\":\\"68af8d7f-441b-44f2-96ef-70014d4783f5\\",\\"label\\":\\"Price justification — Version A should explain why each package costs what it does\\"},{\\"id\\":\\"F3oE6JsDwMii\\",\\"ref\\":\\"988848a2-16b2-44d6-ad5e-757debe1296e\\",\\"label\\":\\"Nothing — giving options respects client autonomy and lets them choose what fits their budget\\"},{\\"id\\":\\"0atA6sODQROk\\",\\"ref\\":\\"bcb2e3d0-0f7c-4d27-a3ec-146d213413db\\",\\"label\\":\\"A softer close — \\\\\\"I'll go ahead and get that set up\\\\\\" in Version B is too assumptive\\"},{\\"id\\":\\"WPW2kUlAPY2C\\",\\"ref\\":\\"04352c52-8bca-4f07-be80-a75101856210\\",\\"label\\":\\"The discount mention — Version A should emphasize savings more prominently\\"}]},{\\"id\\":\\"1Afb3027IItR\\",\\"ref\\":\\"e68aed88-e229-47f9-a4d9-207d82c49344\\",\\"type\\":\\"multiple_choice\\",\\"title\\":\\"{{var:health_text}}\\\\n\\\\nQuick one. When should you start NBG?\\",\\"properties\\":{},\\"choices\\":[{\\"id\\":\\"ntKNrWNAJQdT\\",\\"ref\\":\\"331a5579-f138-4774-b6eb-ccd552e02a08\\",\\"label\\":\\"With 10-15 minutes left — enough time to do all three steps well\\"},{\\"id\\":\\"mKGmx4NCEqRO\\",\\"ref\\":\\"58a5c8fb-2db3-4ac3-ad17-4bfc2b0a2b79\\",\\"label\\":\\"With 2-3 minutes left — maximize coaching time, then transition quickly\\"},{\\"id\\":\\"XHgzpfsZZICk\\",\\"ref\\":\\"8aa2f84d-3ba5-4224-998a-e1cfc1d0099b\\",\\"label\\":\\"Whenever there's a natural pause — forcing a transition feels inauthentic\\"},{\\"id\\":\\"9Z6NWjDbCzOc\\",\\"ref\\":\\"92cc6071-ddf2-4992-9671-0820ee48bd12\\",\\"label\\":\\"After the client signals they're ready — wait for them to ask about next steps\\"},{\\"id\\":\\"IE8GQOKvj7ws\\",\\"ref\\":\\"d990e7d0-d250-4f17-8c88-bca7479e3dd9\\