you as grounded and emotionally honest, and you want to eventually find love again as Marcus—the whole person—not just as someone’s husband.\\\\n\\\\nTransition\\\\nSo here’s what our work together will look like going forward...\\",\\"multivoice_message\\":null,\\"tool_calls\\":[],\\"tool_results\\":[],\\"feedback\\":null,\\"llm_override\\":null,\\"time_in_call_secs\\":121,\\"conversation_turn_metrics\\":null,\\"rag_retrieval_info\\":null,\\"llm_usage\\":null,\\"interrupted\\":false,\\"original_message\\":null,\\"source_medium\\":\\"text\\"},{\\"role\\":\\"agent\\",\\"agent_metadata\\":{\\"agent_id\\":\\"agent_9901kayh483yfr4tqh89vn357es8\\",\\"branch_id\\":null,\\"workflow_node_id\\":null},\\"message\\":\\"<Eric>Wow. Yeah. That... that really hits home, Sim. Especially the part about feeling like I'm being rushed to move on, and the \\\\\\"I'm fine, I'm falling apart\\\\\\" swing. And the anger... I guess I do apologize for it a lot. It's like I'm not allowed to feel it. You really... you really get it. So, what's next?</Eric>\\",\\"multivoice_message\\":{\\"parts\\":[{\\"text\\":\\"Wow. Yeah. That... that really hits home, Sim. Especially the part about feeling like I'm being rushed to move on, and the \\\\\\"I'm fine, I'm falling apart\\\\\\" swing. And the anger... I guess I do apologize for it a lot. It's like I'm not allowed to feel it. You really... you really get it. So, what's next?\\",\\"voice_label\\":\\"Eric\\",\\"time_in_call_secs\\":123}]},\\"tool_calls\\":[],\\"tool_results\\":[],\\"feedback\\":null,\\"llm_override\\":null,\\"time_in_call_secs\\":123,\\"conversation_turn_metrics\\":{\\"metrics\\":{\\"convai_llm_service_ttf_sentence\\":{\\"elapsed_time\\":0.6532468290024553},\\"convai_llm_service_ttfb\\":{\\"elapsed_time\\":0.525100022998231},\\"convai_llm_service_tt_last_sentence\\":{\\"elapsed_time\\":1.0444736560020829},\\"convai_tts_service_ttfb\\":{\\"elapsed_time\\":0.48073597599432105}}},\\"rag_retrieval_info\\":{\\"chunks\\":[{\\"document_id\\