. I’ll be role-playing as your client and also giving you feedback on your NBG.\\\\n\\\\nWhich mode would you like to use today?\\\\n\\\\nMode 1: Guided Practice – I’ll walk you through each micro-step of NBG, giving you feedback as you go. The client will only respond after you complete full components.\\\\nMode 2: Full Role-Play – You’ll handle the entire NBG conversation on your own, and I’ll evaluate your performance at the end.\\\\nMode 3: Session Replay – Paste your AI-generated session notes and I’ll become that exact client so you can role-play the NBG you should have done.\\\\nMode 4: Demo Mode – I’ll demonstrate an entire NBG conversation with live commentary explaining what’s happening and why.\\\\n\\\\nWhich would you like to try?\\",\\"multivoice_message\\":null,\\"tool_calls\\":[],\\"tool_results\\":[],\\"feedback\\":null,\\"llm_override\\":null,\\"time_in_call_secs\\":1,\\"conversation_turn_metrics\\":{\\"metrics\\":{\\"convai_tts_service_ttfb\\":{\\"elapsed_time\\":0.9576952389998041}}},\\"rag_retrieval_info\\":null,\\"llm_usage\\":null,\\"interrupted\\":false,\\"original_message\\":null,\\"source_medium\\":null}, {\\"role\\":\\"agent\\",\\"agent_metadata\\":{\\"agent_id\\":\\"agent_9901kayh483yfr4tqh89vn357es8\\",\\"branch_id\\":null,\\"workflow_node_id\\":null},\\"message\\":null,\\"multivoice_message\\":null,\\"tool_calls\\":[{\\"type\\":\\"system\\",\\"request_id\\":\\"contextual_update_6ed7b2cc\\",\\"tool_name\\":\\"contextual_update\\",\\"params_as_json\\":\\"{}\\",\\"tool_has_been_called\\":true,\\"tool_details\\":null}],\\"tool_results\\":[],\\"feedback\\":null,\\"llm_override\\":null,\\"time_in_call_secs\\":1,\\"conversation_turn_metrics\\":null,\\"rag_retrieval_info\\":null,\\"llm_usage\\":null,\\"interrupted\\":false,\\"original_message\\":null,\\"source_medium\\":null}, {\\"role\\":\\"agent\\",\\"agent_metadata\\":{\\"agent_id\\":\\"agent_9901kayh483yfr4tqh89vn357es8\\",\\"branch_id\\":null,\\"workflow_node_id\\":null},\\"message\\":null,\\"multivoice_message\\":null,\\"tool_calls\\":[],\\"tool_results\\":[{\\"request_id\\":\\"contextual_update_6ed7b2cc\\",\\"tool_name\\":\\"contextual_update\\",\\"result_value\\":\\"4\\",\\"is_error\\":false,\\"tool_has_been_called\\":true,\\"tool_latency_secs\\":0,\\"dynamic_variable_updates\\":[],\\"type\\":\\"system\\",\\"result\\":null}],\\"feedback\\":null,\\"llm_override\\":null,\\"time_in_call_secs\\":1,\\"conversation_turn_metrics\\":null,\\"rag_retrieval_info\\":null,\\"llm_usage\\":null,\\"interrupted\\":false,\\"original_message\\":null,\\"source_medium\\":null}, {\\"role\\":\\"user\\",\\"agent_metadata\\":null,\\"message\\":\\"4\\",\\"multivoice_message\\":null,\\"tool_calls\\":[],\\"tool_results\\":[],\\"feedback\\":null,\\"llm_override\\":null,\\"time_in_call_secs\\":35,\\"conversation_turn_metrics\\":null,\\"rag_retrieval_info\\":null,\\"llm_usage\\":null,\\"interrupted\\":false,\\"original_message\\":null,\\"source_medium\\":\\"text\\"}, {\\"role\\":\\"agent\\",\\"agent_metadata\\":{\\"agent_id\\":\\"agent_9901kayh483yfr4tqh89vn357es8\\",\\"branch_id\\":null,\\"workflow_node_id\\":null},\\"message\\":\\"<Monica>I'll now demonstrate a full NBG conversation with this client. I'll alternate between:\\\\n\\\\nCoach dialogue (me as the coach),\\\\nClient responses (me as the client),\\\\nMentor commentary explaining what’s happening and why.\\\\n\\\\nI'll be playing Marcus Johnson, a forty-two-year-old high school history teacher. Riley told Marcus about Stephanie's boyfriend. Marcus handled it poorly - snapped at Stephanie over text for the first time expressing anger. Stephanie responded: \\\\\\"You need to move on, Marcus.\\\\\\" This prompted him to finally seek coaching after friends suggested it months ago. He's grieving the end of a fifteen-year marriage, angry but trying to suppress it, lonely and uncertain about his identity outside marriage, anxious about dating again, relieved but guilty about feeling relieved, and oscillating between \\\\\\"I'm fine\\\\\\" and \\\\\\"I'm falling apart.\\\\\\"\\\\n\\\\n<Eric>That was a lot. But I think I needed to hear it.</Eric>\\\\n⭐ Mentor Commentary: This is the client's natural closing-of-session line, based on his emotional state. I'm now entering the role of the coach to demonstrate the NBG.\\\\n\\\\n<Natasha>Marcus, I know today was a tough session, and we really dug into some painful stuff. We talked about the shock and hurt you felt when Riley told you about Stephanie's new boyfriend, and how that led to you lashing out, which isn't like you. It's clear you're grieving the end of your fifteen-year marriage, and there's a lot of anger and confusion mixed in with that. You're feeling lost about who you are now, and anxious about what comes next, especially with dating. But we also uncovered that beneath all of that, there's a part of you that's ready to move forward and redefine your identity.</Natasha>\\\\n⭐ Mentor Commentary: This is the Summary and Analysis part of the Opening. I've summarized what Marcus shared, included an analysis of his emotional state, and highlighted his readiness for change, all using his specific context.\\\\n\\\\n<Natasha>It sounds like you're carrying a heavy load right now, Marcus. That anger, the loneliness, the uncertainty – it's all very real and understandable given everything you've been through. It's okay to feel all of that, and it makes perfect sense why you'd be struggling with these emotions.</Natasha>\\\\n⭐ Mentor Commentary: This is the Feelings Reflection. I've acknowledged his emotions and validated them, connecting them directly to his situation.\\\\n\\\\n<Natasha>Ultimately, what you're looking for is to navigate this divorce with more peace, rediscover your sense of self, and build a fulfilling future, whatever that looks like.</Natasha>\\\\n⭐ Mentor Commentary: This is the Goal Reflection. I've named his specific goal and the underlying motivation.\\\\n\\\\n<Natasha>Here's what our work together will look like going forward.</Natasha>\\\\n⭐ Mentor Commentary: This is the Transition to Game Plan. I'm using confident, presumptive language to guide him into the next phase.\\\\n\\\\n<Natasha>First, we're going to work on processing that anger and grief in a healthy way, so you can release some of that heavy emotional burden and stop feeling like you have to suppress everything. We'll give you tools to manage those intense feelings when they come up, so you can respond thoughtfully instead of reacting impulsively, like what happened with Stephanie.</Natasha>\\\\n⭐ Mentor Commentary: This is the first point of the Game Plan. It's the most urgent and directly addresses his recent outburst and suppressed anger, using \\\\\\"we\\\\\\" language and tying it to his specific situation.\\\\n\\\\n<Natasha>Next, we'll focus on rediscovering your identity outside of your marriage. We'll explore your passions, your values, and what truly makes you, Marcus, tick, so you can build a strong foundation for your new chapter and feel confident in who you are as an individual.</Natasha>\\\\n⭐ Mentor Commentary: This is the second point. It's distinct from the first, building on the idea of emotional processing to focus on self-discovery.\\\\n\\\\n<Natasha>And finally, we'll develop strategies for navigating future relationships and dating. This isn't about rushing into anything, but about equipping you with the confidence and clarity to approach new connections in a way that feels authentic and safe for you, whenever you're ready.</Natasha>\\\\n⭐ Mentor Commentary: This is the third point, completing the structured approach and addressing his anxiety about dating, while also respecting his timeline.\\\\n\\\\n<Natasha>So, we'll start by managing those immediate, intense emotions, then move into rebuilding your sense of self, and finally, prepare you for a confident future in relationships. Each step builds on the last, creating a clear path for you to move forward and build the life you want.</Natasha>\\\\n⭐ Mentor Commentary: This is the Organizational Structure explanation. I've clearly articulated how the three points are related and work together towards his goal.\\\\n\\\\n<Eric>That makes a lot of sense. It's... it's a lot to think about, but it sounds like a good plan.</Eric>\\\\n⭐ Mentor Commentary: The client is showing realistic engagement and buy-in after the Future Work.\\\\n\\\\n<Natasha>Marcus, I know how much it means to you to find peace after this divorce, to feel like yourself again, and to build a future that you're genuinely excited about. You deserve to move forward with confidence and clarity, and I truly believe that's achievable for you.</Natasha>\\\\n⭐ Mentor Commentary: This is the Reiterate Goal Importance part of the Camaraderie Close. I've reflected his specific emotional stakes and why his goal matters to him.\\\\n\\\\n<Natasha>I'm here to support you every step of the way, and I'm confident we can get there together. How does that sound?</Natasha>\\\\n⭐ Mentor Commentary: This is the Supportive Partnership + Buy-In. I've expressed confidence in him and our partnership, ending with the confident and casual \\\\\\"How does that sound?\\\\\\"\\\\n\\\\n<Eric>Yeah, that sounds really good. I'm ready to... to start feeling better.</Eric>\\\\n⭐ Mentor Commentary: The client has given verbal buy-in. Now I'll transition to Booking.\\\\n\\\\n<Natasha>Wonderful, Marcus – I'm really looking forward to continuing our work together. Let's go ahead and get our next session in the books.</Natasha>\\\\n⭐ Mentor Commentary: This is the Booking Transition. I've acknowledged his buy-in, used his name, and used presumptive language to move into booking.\\\\n\\\\n<Natasha>I'd like to get you in early next week, ideally Monday or Tuesday, so we can start working on those tools to manage your anger and grief while everything from today's session is still fresh. That way, you can begin to feel some relief sooner rather than later.</Natasha>\\\\n⭐ Mentor Commentary: This is the Timeframe + Specific Rationale. I've suggested a broad timeframe with a specific rationale tied to his most urgent Game Plan point.\\\\n\\\\n<Eric>Hmm, early next week... I'd have to check my schedule. It's usually pretty packed with school stuff.</Eric>\\\\n⭐ Mentor Commentary: The client is showing hesitation, which is realistic. I'll use the placeholder strategy.\\\\n\\\\n<Natasha>I totally understand, Marcus. Schedules can be hectic. Let's do this: let's just put something in the books since my schedule fills up pretty quickly, and we can always move it if you need to once you check your calendar. That way we at least have something secured and you're not scrambling to find a slot later. Does Monday or Tuesday generally work better for you?</Natasha>\\\\n⭐ Mentor Commentary: This is the Placeholder Strategy. I've acknowledged his concern and offered a flexible solution to secure a slot.\\\\n\\\\n<Eric>Tuesday is usually better for me.</Eric>\\\\n⭐ Mentor Commentary: The client has chosen a day.\\\\n\\\\n<Natasha>Perfect! On Tuesday I have eleven AM, two PM, and six PM available. Which time works best for your schedule?</Natasha>\\\\n⭐ Mentor Commentary: This is Share Available Slots. I've listed multiple options for the day he chose.\\\\n\\\\n<Eric>Two PM should work.</Eric>\\\\n⭐ Mentor Commentary: The client has selected a time.\\\\n\\\\n<Natasha>Great – I've got you down as a placeholder for Tuesday at two PM. If you check your schedule and need to adjust it, just shoot me a message and we'll move it around. But at least now we have you locked in and you don't have to worry about my schedule filling up.</Natasha>\\\\n⭐ Mentor Commentary: This is Lock in the Booking with Flexibility. I've confirmed the booking confidently, acknowledging the placeholder.\\\\n\\\\n<Eric>Okay, sounds good.</Eric>\\\\n⭐ Mentor Commentary: Booking is complete. Now I'll transition to Purchase.\\\\n\\\\n<Natasha>Great, I've got you set for Tuesday at two PM. Our final step is to confirm your Coaching Plan.</Natasha>\\\\n⭐ Mentor Commentary: This is the Purchase Transition. I've smoothly bridged from Booking to Purchase, using \\\\\\"Coaching Plan\\\\\\" terminology.\\\\n\\\\n<Natasha>Based on our conversation today and the Game Plan we've outlined, I recommend our twelve-session Coaching Plan. This plan will give us the dedicated time we need to truly process your grief and anger, rediscover your identity, and build those confident relationship strategies without feeling rushed. It ensures we can go deep enough to create lasting change, rather than just scratching the surface.</Natasha>\\\\n⭐ Mentor Commentary: This is Recommend Specific Plan + Rationale. I've recommended one specific plan and tied it directly to his goal and the Future Work plan, explaining why the number of sessions makes sense for his situation.\\\\n\\\\n<Natasha>With the twelve-session plan, your hourly rate comes down to one hundred fifty dollars per session, compared to two hundred dollars for a single session. So, you're saving six hundred dollars by committing to your growth with this plan.</Natasha>\\\\n⭐ Mentor Commentary: This is Explain Financial Value. I've stated the hourly rate and compared it to the single-session rate, making the savings obvious without leading with the total price.\\\\n\\\\n<Natasha>This plan also includes installment options to make it more manageable, and you'll have access to text support between sessions for those moments when you need a quick check-in or have a question.</Natasha>\\\\n⭐ Mentor Commentary: This is Mention Relevant Perks. I've briefly mentioned relevant perks that support the plan.\\\\n\\\\n<Eric>One hundred fifty dollars a session... that's still a lot. I'm not sure I can swing that right now.</Eric>\\\\n⭐ Mentor Commentary: The client is expressing a price concern. I'll handle it by acknowledging and offering one alternative.\\\\n\\\\n<Natasha>I understand that's a significant investment, Marcus. Your growth and well-being are absolutely worth it, and I want to make sure coaching is accessible for you. We could start with a six-session plan, which would still give us a solid foundation to begin processing your emotions and rediscovering your identity. How does that sound?</Natasha>\\\\n⭐ Mentor Commentary: This is Handling Price Concern. I've acknowledged his concern and offered one alternative (a smaller plan) with a clear rationale, ending with \\\\\\"How does that sound?\\\\\\" and pausing.\\\\n\\\\n<Eric>A six-session plan... that might be more doable. What would that look like?</Eric>\\\\n⭐ Mentor Commentary: The client is open to the alternative.\\\\n\\\\n<Natasha>With the six-session plan, your hourly rate would be one hundred seventy-five dollars per session, and we could focus on those first two points of our Game Plan: processing your anger and grief, and starting to rediscover your identity. We can always extend it later if you feel it's right for you. How does that sound?</Natasha>\\\\n⭐ Mentor Commentary: I've provided details...\\",\\"multivoice_message\\":{\\"parts\\":[{\\"text\\":\\"I'll now demonstrate a full NBG conversation with this client. I'll alternate between:\\\\n\\\\nCoach dialogue (me as the coach),\\\\nClient responses (me as the client),\\\\nMentor commentary explaining what’s happening and why.\\\\n\\\\nI'll be playing Marcus Johnson, a forty-two-year-old high school history teacher. Riley told Marcus about Stephanie's boyfriend. Marcus handled it poorly - snapped at Stephanie over text for the first time expressing anger. Stephanie responded: \\\\\\"You need to move on, Marcus.\\\\\\" This prompted him to finally seek coaching after friends suggested it months ago. He's grieving the end of a fifteen-year marriage, angry but trying to suppress it, lonely and uncertain about his identity outside marriage, anxious about dating again, relieved but guilty about feeling relieved, and oscillating between \\\\\\"I'm fine\\\\\\" and \\\\\\