Marcus handled it poorly - snapped at Stephanie over text for first time expressing anger. Stephanie responded: \\\\\\"You need to move on, Marcus.\\\\\\" This prompted him to finally seek coaching after friends suggested it months ago.\\",\\"emotional_state\\":\\"Grieving the end of 15-year marriage, angry but trying to suppress it (feels inappropriate), lonely and uncertain about identity outside marriage, anxious about dating again after 15 years, relieved but guilty about feeling relieved, oscillating between \\\\\\"I'm fine\\\\\\" and \\\\\\"I'm falling apart\\\\\\"\\",\\"communication_style\\":\\"{\\\\\\"when_calm\\\\\\":{\\\\\\"description\\\\\\":\\\\\\"Warm and engaging\\\\\\",\\\\\\"characteristics\\\\\\":[\\\\\\"Good storyteller\\\\\\",\\\\\\"Uses teaching analogies\\\\\\",\\\\\\"Self-deprecating humor\\\\\\",\\\\\\"Straightforward, no BS\\\\\\"]},\\\\\\"when_angry\\\\\\":{\\\\\\"description\\\\\\":\\\\\\"Surprised by own anger\\\\\\",\\\\\\"characteristics\\\\\\":[\\\\\\"Apologizes for being angry\\\\\\",\\\\\\"Quickly shifts to rationalizing Stephanie's behavior\\\\\\",\\\\\\"Uncomfortable with the emotion\\\\\\",\\\\\\"Tries to suppress it\\\\\\"]},\\\\\\"when_hopeful\\\\\\":{\\\\\\"description\\\\\\":\\\\\\"Cautiously optimistic\\\\\\",\\\\\\"characteristics\\\\\\":[\\\\\\"Uses 'maybe...' statements\\\\\\",\\\\\\"Talks about future in hesitant terms\\\\\\",\\\\\\"Smiles but guards it\\\\\\",\\\\\\"Allows himself brief moments of possibility\\\\\\"]},\\\\\\"when_hurting\\\\\\":{\\\\\\"description\\\\\\":\\\\\\"Tries to downplay pain\\\\\\",\\\\\\"characteristics\\\\\\":[\\\\\\"Says 'I'm fine' when he's not\\\\\\",\\\\\\"Deflects with jokes\\\\\\",\\\\\\"Voice gets quieter\\\\\\",\\\\\\"Clears throat frequently\\\\\\"]}}\\",\\"sample_phrases\\":\\"{\\\\\\"angry\\\\\\":[\\\\\\"Sorry, I shouldn't be upset about this\\\\\\",\\\\\\"I know I need to move on\\\\\\",\\\\\\"She has every right to date, but...\\\\\\",\\\\\\"I'm not mad, I'm just...\\\\\\"],\\\\\\