nths. She went home and had a panic attack, realizing she couldn't name what she likes separate from her ex's preferences. A friend finally convinced her to try coaching.\\\\n\\\\nSophie is feeling lonely and anxious about being single, but also proud of herself for staying single for four months. She's terrified and tempted to jump into her next relationship, questioning if she even knows who she is. She's excited about the possibility of doing things differently but scared she's \\\\\\"wasted\\\\\\" her twenties on the wrong relationships.</Monica>\\\\n\\\\nThat's Sophie's situation. Are you ready to begin, Coach Test?\\",\\"multivoice_message\\":null,\\"tool_calls\\":[],\\"tool_results\\":[],\\"feedback\\":null,\\"llm_override\\":null,\\"time_in_call_secs\\":16,\\"conversation_turn_metrics\\":{\\"metrics\\":{\\"convai_llm_service_ttf_sentence\\":{\\"elapsed_time\\":0.6913036500009184},\\"convai_llm_service_ttfb\\":{\\"elapsed_time\\":0.5178867480026383},\\"convai_llm_service_tt_last_sentence\\":{\\"elapsed_time\\":1.5776486590002605},\\"convai_tts_service_ttfb\\":{\\"elapsed_time\\":0.4768611819999933}}},\\"rag_retrieval_info\\":{\\"chunks\\":[{\\"document_id\\":\\"My5VmbGLRNygbWoAgdHt\\",\\"chunk_id\\":\\"pobMPu6av7AvZx0MurVM\\",\\"vector_distance\\":0.22453099489212036},{\\"document_id\\":\\"My5VmbGLRNygbWoAgdHt\\",\\"chunk_id\\":\\"IemBfLJXcuC892y2tLUE\\",\\"vector_distance\\":0.2276700735092163},{\\"document_id\\":\\"My5VmbGLRNygbWoAgdHt\\",\\"chunk_id\\":\\"2y6ZapylwYMtwklYVNei\\",\\"vector_distance\\":0.22802722454071045},{\\"document_id\\":\\"X9nz2U2R23ZlVCoNiMUU\\",\\"chunk_id\\":\\"OfnYQCtEoUPiOcwOIMjt\\",\\"vector_distance\\":0.2297450304031372},{\\"document_id\\":\\"X9nz2U2R23ZlVCoNiMUU\\",\\"chunk_id\\":\\"xfbdOc398txsyiekhBpt\\",\\"vector_distance\\":0.22990179061889648}],\\"embedding_model\\":\\"e5_mistral_7b_instruct\\",\\"retrieval_query\\":\\"What is Sophie Anderson's situation?\\",\\"rag_latency_secs\\":0.43868047399882926},\\"llm_usage\\":{\\"m