\\n\\\\n<Monica>Coach: \\\\\\"Then, once you have a clearer handle on those emotions, we'll start exploring what this 'new Marcus' looks like. We'll identify your core values, rediscover your passions outside of the marriage, and build a strong sense of self that isn't dependent on a relationship. This will give you a solid internal compass for your future.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"I like that. A compass. I feel a bit lost right now, so that would be good.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The second Game Plan point is distinct and builds logically on the first. It addresses his stated need for a new identity and uses a metaphor ('compass') that resonates with his feeling of being 'lost.' It shows a clear progression.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"And finally, with that strong foundation, we'll develop practical strategies for re-engaging with the world, including navigating the idea of dating again. We'll work on building your confidence in social situations and help you feel genuinely excited about the possibility of new connections, rather than anxious.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Oh, dating. [He chuckles nervously] That's a big one. But yeah, I guess eventually I'll have to face that. It would be nice to feel excited instead of terrified.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The third point completes the plan, addressing his anxiety about dating and tying it back to building confidence. It's distinct and shows a comprehensive path forward. The coach acknowledged his nervousness but kept the focus on the positive outcome.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"So, to put it all together, we'll first process the past to gain emotional control, then build your new identity and internal compass, and finally, equip you with the confidence to re-engage with the world and dating. It's a structured approach designed to move you from feeling stuck and uncertain to feeling empowered and hopeful about your future.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"That sounds like... a lot. But it also sounds like what I need. I can see how those pieces fit together.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach clearly articulated the organizational structure of the Game Plan, showing how the three points are connected and work together. Marcus's response indicates he understands and sees the value in the cohesive plan.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Marcus, I truly believe that you deserve to move past this pain and build a future that excites you. I'm here to support you every step of the way, and I'm confident that together, we can get you to that place where you feel strong, clear, and ready for whatever comes next. How does that sound?\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Yeah, that sounds really good. I appreciate that. It's... it's a relief to hear someone say that.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"This is a Gold Standard Camaraderie Close. The coach reiterated the importance of his goal, expressed confidence in him and the partnership, and ended with the perfect 'How does that sound?' Marcus's response shows genuine buy-in and relief.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Great, I’m looking forward to continuing our work together, Marcus. Let’s go ahead and get our next session in the books so we can keep this momentum going and start building that new foundation for you.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Okay, yeah, let's do that. I don't want to lose this feeling.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The transition to Booking was smooth, presumptive, and used Marcus's name. It acknowledged his buy-in and linked the booking directly to maintaining the positive momentum from the Future Work.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Fantastic. Given what we just talked about with processing your emotions and building that new identity, I think it would be really beneficial to get our next session in early next week. That way, we can dive into that first Game Plan point while everything is still fresh for you.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Early next week... Hmm. I usually have a staff meeting on Monday mornings. What about Tuesday or Wednesday?\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach provided a clear timeframe ('early next week') with a specific rationale directly tied to the first Game Plan point and Marcus's current emotional state. Marcus's response is a natural, realistic hesitation, not a rejection.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Totally understandable, Marcus. Let's look at Tuesday or Wednesday then. What day works best for you?\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Tuesday would be better. Wednesdays are usually packed with grading.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach handled the hesitation well by acknowledging it and then directly asking for his preferred day within the suggested timeframe.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Okay, great. For Tuesday, I have openings at ten AM, one PM, or three PM. Which of those works best with your schedule?\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Let's do the one PM slot. That gives me time after my morning classes.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach offered multiple clear time slots for the chosen day, making it easy for Marcus to select one.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Perfect – I’ve got you locked in for next Tuesday at one PM. I'll send over the calendar invite right after this call.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Great, thanks. That's one less thing to worry about.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The booking was confirmed confidently and clearly, specifying the day and time. Marcus's relief shows the value of a smooth booking process.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Excellent, Marcus. I’ve got you set for next Tuesday at one PM. Our final step is to confirm your Coaching Plan so we can ensure you have consistent support on this journey.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Coaching Plan, okay. What does that look like?\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The transition to Purchase was smooth, using the 'Coaching Plan' terminology and linking it to consistent support, which aligns with Marcus's need for a structured path forward.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Based on our conversation today and the three-point Game Plan we outlined, I recommend our twelve-session 'Reinvention Roadmap' plan. This plan is designed to give us the dedicated time to deeply process your past, build that strong new identity, and confidently prepare you for dating again, ensuring you don't just move on, but move forward with purpose. It gives us enough sessions to really embed these changes and provide consistent support through all the ups and downs.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Twelve sessions... that sounds like a big commitment. What's the cost for something like that?\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach recommended a specific plan (twelve sessions) and provided a strong rationale directly tied to Marcus's goals and the Game Plan. It used 'we' language and emphasized the depth of support. Marcus's question about cost is a natural response to a larger commitment.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"That's a great question, Marcus. With the 'Reinvention Roadmap' plan, your investment per session comes out to one hundred fifty dollars, which is a significant saving compared to our single-session rate of two hundred dollars. So, you're getting a much better value by committing to the full plan, ensuring you have that consistent support at a lower per-session cost.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"One hundred fifty a session... so that's eighteen hundred total. That's... a lot for a teacher's salary.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach clearly explained the financial value by stating the hourly rate and comparing it to the single-session rate, highlighting the savings. They avoided leading with the total price, but Marcus calculated it, which is a common client behavior. Now the coach needs to handle the price concern.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"I completely understand that eighteen hundred dollars feels like a significant investment, Marcus. And it is. This is an investment in your future, in building that confident new identity we talked about. We also have an option for you to pay in three monthly installments of six hundred dollars, which can make it more manageable. How does that sound?\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Installments... that does help. Six hundred a month is still a chunk, but it's not as daunting as eighteen hundred all at once. Okay, I think I can do that.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach handled the price concern beautifully. They acknowledged Marcus's concern, reframed the cost as an investment in his future, and offered one alternative (installments) at a time, then paused for his response. This allowed Marcus to process and accept the alternative.\\\\\\"</Monica>\\\\n\\\\n<Monica>Coach: \\\\\\"Fantastic, Marcus. I’ll go ahead and process your 'Reinvention Roadmap' Coaching Plan with the three monthly installments. I'll send you a confirmation email with all the details right away. I'm really looking forward to our work together next Tuesday.\\\\\\"</Monica>\\\\n\\\\n<Marcus>Marcus: \\\\\\"Me too. Thanks, I really appreciate this.\\\\\\"</Marcus>\\\\n\\\\n<Monica>⭐ Mentor Commentary: \\\\\\"The coach closed confidently and presumptively, using the 'Coaching Plan' terminology and confirming the chosen payment option. Marcus's final response shows he's fully bought in and ready to move forward. This was a Gold Standard NBG demonstration from start to finish.\\\\\\"</Monica>\\\\n\\\\n<Monica>That concludes the demo. This demonstration showcased:\\\\n- A clear, empathetic Opening that summarized Marcus's situation and validated his emotions.\\\\n- A structured, client-specific Game Plan that addressed his core needs and provided a clear path forward.\\\\n- A warm and confident Camaraderie Close that secured his buy-in.\\\\n- A smooth Booking process with a specific rationale and effective handling of his schedule.\\\\n- A confident Purchase recommendation, clear value explanation, and skillful handling of his price concern with a single, manageable alternative.\\\\n\\\\nReady to try it yourself? You can open a fresh chat or continue here with Mode 1 (Guided) or Mode 2 (Full Role-Play).</Monica>\\",\\"source_medium\\":null}],\\"metadata\\":{\\"start_time_unix_secs\\":1764782344,\\"accepted_time_unix_secs\\":1764782344,\\"call_duration_secs\\":192,\\"cost\\":1814,\\"deletion_settings\\":{\\"deletion_time_unix_secs\\":null,\\"deleted_logs_at_time_unix_secs\\":null,\\"deleted_audio_at_time_unix_secs\\":null,\\"deleted_transcript_at_time_unix_secs\\":null,\\"delete_transcript_and_pii\\":false,\\"delete_audio\\":false},\\"feedback\\":{\\"type\\":null,\\"overall_score\\":null,\\"likes\\":0,\\"dislikes\\":0,\\"rating\\":null,\\"comment\\":null},\\"authorization_method\\":\\"public\\",\\"charging\\":{\\"dev_discount\\":false,\\"is_burst\\":false,\\"tier\\":\\"growing_business\\",\\"llm_usage\\":{\\"irreversible_generation\\":{\\"model_usage\\":{\\"gemini-2.5-flash\\":{\\"input\\":{\\"tokens\\":12210,\\"price\\":0.0018315},\\"input_cache_read\\":{\\"tokens\\":0,\\"price\\":0},\\"input_cache_write\\":{\\"tokens\\":0,\\"price\\":0},\\"output_total\\":{\\"tokens\\":3224,\\"price\\":0.0019344}}}},\\"initiated_generati