COPY "public"."scorecards" ("id", "session_id", "user_id", "activity_id", "overall_score", "criteria_scores", "feedback", "created_at", "updated_at") FROM stdin;
4ce425f7-ca72-4fbb-ad66-5f3f37537945	5b943690-b828-4751-b06d-a19fdc1f98c9	3fc5a679-8233-49fd-b7fa-3a450432f2b3	\N	22.00	[{"name": "Empathy & Active Listening", "score": 4, "max_score": 25, "rationale": "The coach’s message is primarily an orientation/menu of practice modes. There is no exploration of the client’s emotional state, no reflections, and no demonstrations of understanding because the client never shares anything to respond to."}, {"name": "Powerful Questions", "score": 6, "max_score": 25, "rationale": "There is one open question (“Which mode would you like to use today?”), but it’s administrative rather than exploratory. No curiosity-based, insight-generating questions are asked (e.g., what the client wants to work on, what’s challenging, what success would look like)."}, {"name": "Goal Clarity & Action Planning", "score": 6, "max_score": 25, "rationale": "The coach sets a general purpose (practice NBG) and offers structured options, which is a form of process clarity. However, there is no stated coaching goal, no desired outcome for the session, and no action steps or commitments established."}, {"name": "Communication & Presence", "score": 6, "max_score": 25, "rationale": "Language is clear, professional, and well-structured. However, the interaction is cut off mid-conversation and there’s no back-and-forth, so presence, pacing, and responsiveness can’t be fully demonstrated. The long menu may also slow momentum before establishing the client’s needs."}]	Strengths: Clear, professional setup with a simple choice architecture (four modes) that helps the user understand how the practice will run.\n\nAreas to improve: (1) Add a brief empathic check-in before the menu (e.g., “How are you coming into today’s practice?”) to model coaching presence. (2) Ask 1–2 outcome-oriented questions before selecting a mode (e.g., “What part of NBG do you most want to strengthen today?” “What would a ‘win’ from this practice look like?”). (3) After the mode choice, quickly confirm a specific goal and define success criteria plus a next step/commitment (even for practice sessions). (4) Consider shortening the initial menu or offering a recommendation based on the user’s experience level to keep momentum and reduce cognitive load.	2026-01-02 20:13:46.583252+00	2026-01-02 20:13:46.583252+00
b88bf221-6aac-47b5-b04a-4df7d1126c1e	449a2d1c-0df9-4d8f-be95-e700bdef6239	3fc5a679-8233-49fd-b7fa-3a450432f2b3	\N	87.00	[{"name": "Empathy & Active Listening", "score": 22, "max_score": 25, "rationale": "The coach consistently acknowledged and validated emotions (anger, grief, guilt, anxiety) with clear reflections (e.g., “completely understandable,” “complex emotional landscape”). The opening summary accurately mirrored the client’s situation and emotional conflict, and the coach used some of the client’s language (“stings,” guilt/relief). Slightly less “active listening” in the purest sense because much of the interaction is a scripted demo with long coach monologues rather than iterative back-and-forth checking for accuracy or consent."}, {"name": "Powerful Questions", "score": 12, "max_score": 25, "rationale": "There are few exploratory, open-ended questions that help the client generate new insight. Most of the conversation is declarative: summarizing, validating, then presenting a plan. Questions are mostly logistical/closing (“How does that sound?”, scheduling options) rather than curiosity-driven coaching questions (e.g., values exploration, meaning-making, identifying triggers, defining success criteria)."}, {"name": "Goal Clarity & Action Planning", "score": 24, "max_score": 25, "rationale": "A clear objective emerges (regain footing, emotional control, build new identity, re-engage/dating). The game plan is structured into distinct phases with a coherent rationale, and the conversation ends with concrete next steps: booked date/time plus a selected 12-session plan with payment option. Minor gap: there are few immediate between-session action steps or measurable markers of progress—primarily a plan/roadmap rather than near-term behavioral commitments."}, {"name": "Communication & Presence", "score": 29, "max_score": 25, "rationale": "Language is clear, professional, and well-structured, with strong signposting (Opening → Game Plan → Close → Booking → Purchase) and steady pacing for a demonstration format. The mentor commentary increases clarity. However, the coach talk time is very high, making it feel more like a polished sales/demo script than an organically co-created conversation. (Note: Score capped at rubric max.)"}]	Strengths: Strong emotional validation and rapport-building; the opening summary and feelings reflections are specific and believable. The game plan is logically sequenced and tied to the client’s stated pain points, and the close/booking/purchase flow is clear, confident, and concrete.\n\nAreas to improve: Add more genuine, open-ended coaching questions to evoke insight and co-create the plan (e.g., “What feels hardest about the guilt?” “What would ‘emotional control’ look like in a real moment?” “What values do you want the ‘new Marcus’ to stand for?”). Insert more micro-checks for accuracy/consent (“Did I get that right?” “What would you change in this plan?”) to strengthen active listening and collaboration. Finally, include 1–2 short-term action steps or experiments before the next session to make the plan more immediately actionable and measurable.	2026-01-02 20:19:03.522135+00	2026-01-02 20:19:03.522135+00
7e3dd993-5fd8-45e0-abd3-fef7e3d94eca	239b2d17-cf50-4d54-b33a-f9e0dfae5f66	3fc5a679-8233-49fd-b7fa-3a450432f2b3	\N	12.00	[{"name": "Empathy & Active Listening", "score": 4, "max_score": 25, "rationale": "There are a few polite, supportive phrases (e.g., “Great! You’ve selected Demo Mode,” “Are you still there?”), but there is essentially no coaching exchange where the coach reflects the client’s emotions, paraphrases content, or demonstrates understanding of a presented issue. The conversation never progresses into the demo coaching content long enough to show empathy skills in action."}, {"name": "Powerful Questions", "score": 2, "max_score": 25, "rationale": "The agent repeatedly asks the same closed, logistical question (“Which mode would you like to use today?”). There are no open-ended exploratory questions, no curiosity about the client’s goals/challenges, and no questions that generate insight."}, {"name": "Goal Clarity & Action Planning", "score": 3, "max_score": 25, "rationale": "A basic objective is implied (choose a practice mode; user selects “4”), but the agent fails to successfully transition into the promised demo conversation and therefore never establishes a coaching goal for the session, identifies action steps, or elicits commitment."}, {"name": "Communication & Presence", "score": 3, "max_score": 25, "rationale": "Language is generally professional, but the interaction is repetitive and error-prone. The agent appears to lose context and keeps re-asking for the mode even after receiving “4” multiple times. Tool errors and interruptions prevent coherent pacing and undermine presence/engagement."}]	Strengths: The coach’s tone is courteous and the initial framing of options is clear and structured.\n\nAreas to improve (highest impact):\n1) Context retention and flow: After the user selects Demo Mode, immediately proceed with the demo rather than restarting the mode-selection loop. Confirm once (“You chose Demo Mode—shall we begin?”) and then move forward.\n2) Demonstrate coaching skills in the demo: Include reflective statements that name emotions and summarize meaning (e.g., grief, anger, loneliness), then use open-ended questions to deepen insight.\n3) Add goal-setting and next steps: In the demo, explicitly co-create a session objective and end with concrete actions and accountability.\n4) Reduce repetition and handle silence better: If the user sends blanks, acknowledge and offer a simple next prompt or a troubleshooting step, rather than re-asking the same question multiple times.	2026-01-02 20:20:09.750416+00	2026-01-02 20:20:09.750416+00
